--
-- Name: acquire_task_lock_fn(text); Type: FUNCTION; Schema: public; Owner: dev_service_user
--

CREATE FUNCTION public.acquire_task_lock_fn(param_task_code text) RETURNS boolean
    LANGUAGE plpgsql
    AS $$ 

DECLARE
	var_lock_count integer; 

BEGIN

	SELECT COUNT(1)
	INTO var_lock_count
	FROM public.task_lock tl
	WHERE tl.task_code = param_task_code;
	
	IF var_lock_count = 0 THEN
	
		VALUES (param_task_code, now());
	
		RAISE NOTICE 'Task is free. Creating new task lock...';
		RETURN true;
	ELSE
	
		RAISE NOTICE 'Task is occupied. Aborting...';
		RETURN false;	
	END IF;
END 
$$;


ALTER FUNCTION public.acquire_task_lock_fn(param_task_code text) OWNER TO dev_service_user;

