            NULL::integer AS video_version_id,
            ase.user_id,
            ase.id AS answer_session_id,
            ec.completion_date
           FROM (public.exam_completion ec
             LEFT JOIN public.answer_session ase ON ((ase.id = ec.answer_session_id)))
        UNION ALL
         SELECT NULL::integer AS exam_version_id,
            vc.video_version_id,
            vc.user_id,
            NULL::integer AS answer_session_id,
            vc.completion_date
           FROM public.video_completion vc
        )
 SELECT cice.user_id,
    cice.video_version_id,
    vv.video_id,
    cice.exam_version_id,
    ev.exam_id,
    cice.answer_session_id,
    cice.completion_date,
    cv.id AS course_version_id,
    cv.course_id,
    mv.module_id,
    ex.is_pretest
   FROM (((((course_item_completion_cte cice
     LEFT JOIN public.video_version vv ON ((vv.id = cice.video_version_id)))
     LEFT JOIN public.exam_version ev ON ((ev.id = cice.exam_version_id)))
     LEFT JOIN public.exam ex ON ((ex.id = ev.exam_id)))
     LEFT JOIN public.module_version mv ON (((mv.id = vv.module_version_id) OR (mv.id = ev.module_version_id))))
     LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)));


