--
-- Name: exam_score_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.exam_score_view AS
 WITH flat_cte AS (
         SELECT ase.user_id,
            ev.id AS exam_version_id,
            ase.id AS answer_session_id,
            qv.id AS question_version_id,
            ga.score,
            qd.max_score AS question_max_score,
            ed.title
           FROM (((((public.exam_version ev
             LEFT JOIN public.exam_data ed ON ((ed.id = ev.exam_data_id)))
             JOIN public.answer_session ase ON ((ase.exam_version_id = ev.id)))
             LEFT JOIN public.question_version qv ON ((qv.exam_version_id = ev.id)))
             LEFT JOIN public.question_data qd ON ((qd.id = qv.question_data_id)))
             LEFT JOIN public.given_answer ga ON (((ga.question_version_id = qv.id) AND (ga.answer_session_id = ase.id))))
          ORDER BY ase.user_id, ev.id, ase.id, qv.id
        ), grouped_cte AS (
         SELECT flat.user_id,
            flat.exam_version_id,
            flat.answer_session_id,
            (count(*))::integer AS question_count,
            (COALESCE(sum(flat.score), (0)::bigint))::integer AS exam_score,
            (COALESCE(sum(flat.question_max_score), (0)::bigint))::integer AS exam_max_score,
            (COALESCE(sum(
                CASE
                    WHEN (flat.score IS NOT NULL) THEN 1
                    ELSE 0
                END), (0)::bigint))::integer AS answered_question_count
           FROM flat_cte flat
          GROUP BY flat.exam_version_id, flat.answer_session_id, flat.user_id
          ORDER BY flat.user_id, flat.exam_version_id, flat.answer_session_id
        )
 SELECT grouped.user_id,
    grouped.exam_version_id,
    grouped.answer_session_id,
    grouped.question_count,
    grouped.exam_score,
    grouped.exam_max_score,
    grouped.answered_question_count,
    (round((((grouped.exam_score)::numeric / (grouped.exam_max_score)::numeric) * (100)::numeric), 1))::integer AS score_percentage
   FROM grouped_cte grouped;


ALTER TABLE public.exam_score_view OWNER TO dev_service_user;

--
-- Name: answer_session_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.answer_session_view AS
 WITH answer_stats AS (
         SELECT ase_1.user_id,
            ase_1.id AS answer_session_id,
            (count(ga.id))::integer AS given_answer_count,
            (sum((((ga.state)::text = 'CORRECT'::text))::integer))::integer AS correct_given_answer_count,
            ( SELECT count(*) AS count
                   FROM (public.question_version qv
                     LEFT JOIN public.given_answer ga_1 ON ((ga_1.question_version_id = qv.id)))
                  WHERE (ga_1.answer_session_id = ase_1.id)) AS answered_question_count
           FROM (public.given_answer ga
             LEFT JOIN public.answer_session ase_1 ON ((ase_1.id = ga.answer_session_id)))
          GROUP BY ase_1.user_id, ase_1.id
        )
 SELECT ase.id AS answer_session_id,
    ase.user_id,
    ase.exam_version_id,
    ase.video_version_id,
    ase.start_date,
    esv.exam_score AS answer_session_acquired_points,
    esv.score_percentage AS answer_session_success_rate,
    (esv.score_percentage > COALESCE(ed.acceptance_threshold, 60)) AS is_successful,
    ast.answered_question_count,
    ast.correct_given_answer_count,
    ast.given_answer_count,
    (cic.completion_date IS NOT NULL) AS is_completed,
    cic.completion_date AS end_date,
        CASE
            WHEN ase.is_practise THEN 'practise'::text
            WHEN (e.id = 0) THEN 'signup'::text
            WHEN e.is_pretest THEN 'pretest'::text
            WHEN (ase.video_version_id IS NOT NULL) THEN 'video'::text
            WHEN (ase.exam_version_id IS NOT NULL) THEN 'exam'::text
            ELSE NULL::text
        END AS answer_session_type
   FROM ((((((public.answer_session ase
     LEFT JOIN answer_stats ast ON (((ast.user_id = ase.user_id) AND (ast.answer_session_id = ase.id))))
     LEFT JOIN public.exam_score_view esv ON ((esv.answer_session_id = ase.id)))
     LEFT JOIN public.exam_version ev ON ((ev.id = ase.exam_version_id)))
     LEFT JOIN public.exam_data ed ON ((ed.id = ev.exam_data_id)))
     LEFT JOIN public.exam e ON ((ev.exam_id = e.id)))
     LEFT JOIN public.course_item_completion_view cic ON ((cic.answer_session_id = ase.id)));


ALTER TABLE public.answer_session_view OWNER TO dev_service_user;

