--

CREATE VIEW public.correct_answer_rates_split_view AS
 SELECT u.id AS user_id,
    co.id AS course_id,
    mv.module_id,
    asgv.start_date,
        CASE
            WHEN (asgv.answer_session_type = 'exam'::text) THEN asgv.answer_session_success_rate
            ELSE NULL::numeric
        END AS exam_correct_answer_rate,
        CASE
            WHEN (asgv.answer_session_type = 'practise'::text) THEN asgv.answer_session_success_rate
            ELSE NULL::numeric
        END AS practise_correct_answer_rate,
        CASE
            WHEN (asgv.answer_session_type = 'video'::text) THEN asgv.answer_session_success_rate
            ELSE NULL::numeric
        END AS video_correct_answer_rate
   FROM ((((public."user" u
     CROSS JOIN public.course co)
     LEFT JOIN public.course_version cv ON ((cv.course_id = co.id)))
     LEFT JOIN public.module_version mv ON ((mv.course_version_id = cv.id)))
     LEFT JOIN public.answer_session_group_view asgv ON (((asgv.user_id = u.id) AND (asgv.course_id = co.id))))
  ORDER BY u.id;


