--
-- Name: course_item_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.course_item_view AS
 WITH exam_item AS (
         SELECT mv_1.course_version_id,
            NULL::integer AS video_version_id,
            NULL::integer AS video_id,
            ev.id AS exam_version_id,
            e.id AS exam_id,
            mv_1.id AS module_version_id,
            ed.order_index AS item_order_index,
            ed.title AS item_title,
            ed.subtitle AS item_subtitle,
                CASE
                    WHEN e.is_signup THEN 'signup'::text
                    WHEN e.is_pretest THEN 'pretest'::text
                    WHEN ed.is_final THEN 'final'::text
                    ELSE 'exam'::text
                END AS item_type,
            ('exam_version@'::text || ev.id) AS version_code
           FROM (((public.exam_version ev
             LEFT JOIN public.module_version mv_1 ON ((mv_1.id = ev.module_version_id)))
             LEFT JOIN public.exam e ON ((e.id = ev.exam_id)))
             LEFT JOIN public.exam_data ed ON ((ed.id = ev.exam_data_id)))
        ), video_item AS (
         SELECT mv_1.course_version_id,
            vv.id AS video_version_id,
            v.id AS video_id,
            NULL::integer AS exam_version_id,
            NULL::integer AS exam_id,
            mv_1.id AS module_version_id,
            vd.order_index AS item_order_index,
            vd.title AS item_title,
            vd.subtitle AS item_subtitle,
            'video'::text AS item_type,
            ('video_version@'::text || vv.id) AS version_code
           FROM (((public.video_version vv
             LEFT JOIN public.module_version mv_1 ON ((mv_1.id = vv.module_version_id)))
             LEFT JOIN public.video_data vd ON ((vd.id = vv.video_data_id)))
             LEFT JOIN public.video v ON ((v.id = vv.video_id)))
        ), items_combined AS (
         SELECT video_item.course_version_id,
            video_item.video_version_id,
            video_item.video_id,
            video_item.exam_version_id,
            video_item.exam_id,
            video_item.module_version_id,
            video_item.item_order_index,
            video_item.item_title,
            video_item.item_subtitle,
            video_item.item_type,
            video_item.version_code
           FROM video_item
        UNION ALL
         SELECT exam_item.course_version_id,
            exam_item.video_version_id,
            exam_item.video_id,
            exam_item.exam_version_id,
            exam_item.exam_id,
            exam_item.module_version_id,
            exam_item.item_order_index,
            exam_item.item_title,
            exam_item.item_subtitle,
            exam_item.item_type,
            exam_item.version_code
           FROM exam_item
        )
 SELECT cv.id AS course_version_id,
    md.name AS module_name,
    md.order_index AS module_order_index,
    mv.id AS module_version_id,
    mo.id AS module_id,
    ic.video_version_id,
    ic.video_id,
    ic.exam_version_id,
    ic.exam_id,
    ic.item_order_index,
    ic.item_title,
    ic.item_subtitle,
    ic.item_type,
    ic.version_code
   FROM (((((public.latest_course_version_view lcvv
     LEFT JOIN public.course_version cv ON ((cv.id = lcvv.version_id)))
     LEFT JOIN public.module_version mv ON ((mv.course_version_id = cv.id)))
     LEFT JOIN public.module_data md ON ((md.id = mv.module_data_id)))
     LEFT JOIN public.module mo ON ((mo.id = mv.module_id)))
     JOIN items_combined ic ON (((ic.course_version_id = cv.id) AND (ic.module_version_id = mv.id))))
  ORDER BY cv.id, md.order_index, ic.item_order_index;


ALTER TABLE public.course_item_view OWNER TO dev_service_user;

