--
-- Name: course_spent_time_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.course_spent_time_view AS
 WITH exam_elapsed_time_cte AS (
         SELECT asev.user_id,
            cv.course_id,
            EXTRACT(epoch FROM sum((cicv.completion_date - asev.start_date))) AS exam_elapsed_time
           FROM ((((public.exam_version ev
             LEFT JOIN public.module_version mv ON ((mv.id = ev.module_version_id)))
             LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
             JOIN public.answer_session_view asev ON (((asev.exam_version_id = ev.id) AND (asev.start_date IS NOT NULL))))
             JOIN public.course_item_completion_view cicv ON ((cicv.answer_session_id = asev.answer_session_id)))
          WHERE ((asev.answer_session_type = 'exam'::text) AND (cicv.completion_date IS NOT NULL))
          GROUP BY asev.user_id, cv.course_id
        ), video_watch_elapsed_time_cte AS (
         SELECT vps.user_id,
            cv.course_id,
            sum((vps.to_seconds - vps.from_seconds)) AS video_elapsed_time
           FROM (((public.video_playback_sample vps
             LEFT JOIN public.video_version vv ON ((vv.id = vps.video_version_id)))
             LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)))
             LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
          GROUP BY cv.course_id, vps.user_id
        ), video_question_elapsed_time_cte AS (
         SELECT asv.user_id,
            cv.course_id,
            sum(ga.elapsed_seconds) AS video_question_elapsed_time
           FROM (((((public.given_answer ga
             LEFT JOIN public.answer_session_view asv ON ((asv.answer_session_id = ga.answer_session_id)))
             LEFT JOIN public.question_version qv ON ((qv.id = ga.question_version_id)))
             LEFT JOIN public.video_version vv ON ((vv.id = qv.video_version_id)))
             LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)))
             LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
          WHERE (ga.is_practise_answer IS NOT TRUE)
          GROUP BY asv.user_id, cv.course_id
        ), practise_question_elapsed_time_cte AS (
         SELECT asv.user_id,
            cv.course_id,
            ((count(ga.id) * 15))::integer AS practise_question_elapsed_time
           FROM (((((public.given_answer ga
             LEFT JOIN public.answer_session_view asv ON ((asv.answer_session_id = ga.answer_session_id)))
             LEFT JOIN public.question_version qv ON ((qv.id = ga.question_version_id)))
             LEFT JOIN public.video_version vv ON ((vv.id = qv.video_version_id)))
             LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)))
             LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
          WHERE (ga.is_practise_answer IS TRUE)
          GROUP BY asv.user_id, cv.course_id
        ), spent_time_sum_view_cte AS (
         SELECT eetc_1.user_id,
            eetc_1.course_id,
            sum(eetc_1.exam_elapsed_time) AS total_exam_session_elapsed_time,
            sum(vwetc_1.video_elapsed_time) AS total_video_watch_elapsed_time,
            sum(vqetc_1.video_question_elapsed_time) AS total_video_question_elapsed_time,
            sum(pqetc_1.practise_question_elapsed_time) AS total_practise_question_elapsed_time
           FROM (((exam_elapsed_time_cte eetc_1
             LEFT JOIN video_watch_elapsed_time_cte vwetc_1 ON (((vwetc_1.user_id = eetc_1.user_id) AND (vwetc_1.course_id = eetc_1.course_id))))
             LEFT JOIN video_question_elapsed_time_cte vqetc_1 ON (((vqetc_1.user_id = eetc_1.user_id) AND (vqetc_1.course_id = eetc_1.course_id))))
             LEFT JOIN practise_question_elapsed_time_cte pqetc_1 ON (((pqetc_1.user_id = eetc_1.user_id) AND (pqetc_1.course_id = eetc_1.course_id))))
          GROUP BY eetc_1.user_id, eetc_1.course_id
        )
 SELECT u.id AS user_id,
    co.id AS course_id,
    stsvc.total_exam_session_elapsed_time,
    stsvc.total_video_watch_elapsed_time,
    stsvc.total_video_question_elapsed_time,
    stsvc.total_practise_question_elapsed_time,
    ((((COALESCE(eetc.exam_elapsed_time, (0)::numeric))::double precision + COALESCE(vwetc.video_elapsed_time, (0)::double precision)) + COALESCE(vqetc.video_question_elapsed_time, (0)::double precision)) + (COALESCE(pqetc.practise_question_elapsed_time, 0))::double precision) AS total_spent_seconds
   FROM ((((((public."user" u
     CROSS JOIN public.course co)
     LEFT JOIN exam_elapsed_time_cte eetc ON (((eetc.user_id = u.id) AND (eetc.course_id = co.id))))
     LEFT JOIN video_watch_elapsed_time_cte vwetc ON (((vwetc.user_id = u.id) AND (vwetc.course_id = co.id))))
     LEFT JOIN video_question_elapsed_time_cte vqetc ON (((vqetc.user_id = u.id) AND (vqetc.course_id = co.id))))
     LEFT JOIN practise_question_elapsed_time_cte pqetc ON (((pqetc.user_id = u.id) AND (pqetc.course_id = co.id))))
     LEFT JOIN spent_time_sum_view_cte stsvc ON (((stsvc.user_id = u.id) AND (stsvc.course_id = co.id))))
  ORDER BY u.id, co.id;


ALTER TABLE public.course_spent_time_view OWNER TO dev_service_user;

