--
-- Name: user_course_bridge_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_course_bridge_view AS
 SELECT ucb.id,
    ucb.user_id,
    ucb.course_id,
    ucb.creation_date,
    ucb.course_mode,
    ucb.is_current,
    ucb.current_item_code,
    ucb.stage_name AS current_stage_name,
    ucb.tempomat_mode,
    (ucb.start_date)::date AS start_date,
    (ucb.previsioned_completion_date)::date AS previsioned_completion_date,
    ((ucb.previsioned_completion_date)::date - (ucb.start_date)::date) AS previsioned_length_days,
    (ucb.required_completion_date)::date AS required_completion_date,
    ((ucb.required_completion_date)::date - CURRENT_DATE) AS required_length_days
   FROM public.user_course_bridge ucb;


ALTER TABLE public.user_course_bridge_view OWNER TO dev_service_user;

--
-- Name: user_course_completion_current_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_course_completion_current_view AS
 SELECT sq.user_id,
    sq.course_id,
    sq.start_date,
    sq.required_completion_date,
    sq.previsioned_length_days,
    sq.required_length_days,
    sq.days_elapsed_since_start,
    sq.total_item_count,
    (sq.start_date + ('1 day'::interval day * (sq.previsioned_length_days)::double precision)) AS previsioned_completion_date,
    GREATEST(0, (sq.previsioned_length_days - sq.days_elapsed_since_start)) AS remaining_days,
    ceil(((sq.total_item_count)::numeric / (sq.previsioned_length_days)::numeric)) AS previsioned_items_per_day,
    ceil((((sq.total_item_count)::numeric / (sq.previsioned_length_days)::numeric) * (sq.days_elapsed_since_start)::numeric)) AS previsioned_items_completed_by_now,
    ceil(((100.0 / (sq.previsioned_length_days)::numeric) * (sq.days_elapsed_since_start)::numeric)) AS previsioned_percent_completed_by_now,
    GREATEST(0, (sq.required_length_days - COALESCE(sq.days_elapsed_since_start, 0))) AS required_remaining_days,
    ceil(((sq.total_item_count)::numeric / (sq.required_length_days)::numeric)) AS required_items_per_day,
    ceil((((sq.total_item_count)::numeric / (sq.required_length_days)::numeric) * (COALESCE(sq.days_elapsed_since_start, 1))::numeric)) AS required_items_completed_by_now,
    ceil(((100.0 / (sq.required_length_days)::numeric) * (COALESCE(sq.days_elapsed_since_start, 1))::numeric)) AS required_percent_completed_by_now
   FROM ( SELECT ucbv.user_id,
            ucbv.course_id,
            ucbv.start_date,
            ucbv.required_completion_date,
            ucbv.previsioned_length_days,
            ucbv.required_length_days,
            ((now())::date - ucbv.start_date) AS days_elapsed_since_start,
            cicv.item_count AS total_item_count
           FROM (public.user_course_bridge_view ucbv
             LEFT JOIN public.course_item_count_view cicv ON ((cicv.course_id = ucbv.course_id)))
          ORDER BY ucbv.user_id, ucbv.course_id) sq;


ALTER TABLE public.user_course_completion_current_view OWNER TO dev_service_user;

--
-- Name: user_prequiz_answers_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_prequiz_answers_view AS
 WITH prequiz_question_answers_cte AS (
         SELECT pua.user_id,
            pua.course_id,
            pua.question_id,
            pua.value AS raw_value,
            pa.value AS answer_value,
            pa.id AS answer_id
           FROM (public.prequiz_user_answer pua
             LEFT JOIN public.prequiz_answer pa ON ((pa.id = pua.answer_id)))
          ORDER BY pua.user_id, pua.course_id, pua.question_id
        )
 SELECT ucb.user_id,
    ucb.course_id,
    ( SELECT pqa.raw_value
           FROM prequiz_question_answers_cte pqa
          WHERE ((pqa.user_id = ucb.user_id) AND (pqa.course_id = ucb.course_id) AND (pqa.question_id = 1))) AS experience,
    ( SELECT pqa.answer_id
           FROM prequiz_question_answers_cte pqa
          WHERE ((pqa.user_id = ucb.user_id) AND (pqa.course_id = ucb.course_id) AND (pqa.question_id = 2))) AS planned_usage_answer_id,
    ( SELECT round((((pqa.raw_value * 60) / 7))::double precision) AS round
           FROM prequiz_question_answers_cte pqa
          WHERE ((pqa.user_id = ucb.user_id) AND (pqa.course_id = ucb.course_id) AND (pqa.question_id = 3))) AS estimated_minutes_per_day
   FROM public.user_course_bridge ucb
  ORDER BY ucb.user_id, ucb.course_id;


ALTER TABLE public.user_prequiz_answers_view OWNER TO dev_service_user;

--
-- Name: user_course_completion_original_estimation_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_course_completion_original_estimation_view AS
 SELECT sq.user_id,
    sq.course_id,
    sq.total_item_count,
    sq.start_date,
    sq.estimated_minutes_per_day,
    sq.course_duration_minutes,
    sq.previsioned_duration_days,
    (date_trunc('days'::text, sq.start_date) + ('1 day'::interval day * sq.previsioned_duration_days)) AS previsioned_completion_date,
    ceil(((sq.total_item_count)::double precision / sq.previsioned_duration_days)) AS previsioned_items_per_day
   FROM ( SELECT ucb.user_id,
            ucb.course_id,
            cicv.item_count AS total_item_count,
            date_trunc('days'::text, ucb.creation_date) AS start_date,
            upav.estimated_minutes_per_day,
            ceil(((clev.total_length_seconds)::numeric / 60.0)) AS course_duration_minutes,
            ceil(((((clev.total_length_seconds)::numeric / 60.0))::double precision / upav.estimated_minutes_per_day)) AS previsioned_duration_days
           FROM (((public.user_course_bridge ucb
             LEFT JOIN public.user_prequiz_answers_view upav ON (((upav.user_id = ucb.user_id) AND (upav.course_id = ucb.course_id))))
             LEFT JOIN public.course_length_estimation_view clev ON ((clev.course_id = ucb.course_id)))
             LEFT JOIN public.course_item_count_view cicv ON ((cicv.course_id = ucb.course_id)))
          ORDER BY ucb.user_id, ucb.course_id) sq;


ALTER TABLE public.user_course_completion_original_estimation_view OWNER TO dev_service_user;

--
-- Name: user_course_progress_actual_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_course_progress_actual_view AS
 SELECT sq.user_id,
    sq.course_id,
    sq.days_elapsed_since_start,
    sq.total_completed_item_count,
    sq.total_item_count,
    ((NULLIF(sq.total_completed_item_count, 0))::double precision / NULLIF((sq.days_elapsed_since_start)::double precision, (0)::double precision)) AS avg_completed_items_per_day,
    round((((NULLIF(sq.total_completed_item_count, 0))::double precision / NULLIF((sq.total_item_count)::double precision, (0)::double precision)) * (100)::double precision)) AS completed_percentage,
    (sq.total_item_count - sq.total_completed_item_count) AS remaining_item_count
   FROM ( SELECT ucb.user_id,
            ucb.course_id,
            (((now())::date - (ucb.start_date)::date) + 1) AS days_elapsed_since_start,
            (count(*))::integer AS total_completed_item_count,
            coicv.item_count AS total_item_count
           FROM ((public.user_course_bridge ucb
             LEFT JOIN public.course_item_completion_view cicv ON (((cicv.user_id = ucb.user_id) AND (cicv.course_id = ucb.course_id))))
             LEFT JOIN public.course_item_count_view coicv ON ((ucb.course_id = coicv.course_id)))
          GROUP BY ucb.user_id, ucb.course_id, ucb.start_date, coicv.item_count) sq;


ALTER TABLE public.user_course_progress_actual_view OWNER TO dev_service_user;

--
-- Name: user_course_progress_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_course_progress_view AS
 SELECT sq.user_id,
    sq.course_id,
    sq.previsioned_percent_completed_by_now,
    sq.required_percent_completed_by_now,
    sq.completed_percentage,
    sq.remaining_item_count,
    sq.previsioned_length_days,
    sq.total_item_count,
    sq.remaining_days,
        CASE
            WHEN ((ucb.required_completion_date IS NOT NULL) AND (ucb.start_date IS NOT NULL)) THEN ((sq.required_percent_completed_by_now)::double precision - sq.completed_percentage)
            WHEN ((ucb.required_completion_date IS NULL) AND (ucb.start_date IS NOT NULL)) THEN ((sq.previsioned_percent_completed_by_now)::double precision - sq.completed_percentage)
            ELSE NULL::double precision
        END AS lag_behind_percentage,
    ucb.tempomat_mode
   FROM (( SELECT ucccv.user_id,
            ucccv.course_id,
            ucccv.previsioned_percent_completed_by_now,
            ucccv.required_percent_completed_by_now,
            COALESCE(ucpa.completed_percentage, (0)::double precision) AS completed_percentage,
            ucpa.remaining_item_count,
            ucccv.previsioned_length_days,
            ucccv.total_item_count,
            ucccv.remaining_days
           FROM (public.user_course_completion_current_view ucccv
             LEFT JOIN public.user_course_progress_actual_view ucpa ON (((ucpa.course_id = ucccv.course_id) AND (ucpa.user_id = ucccv.user_id))))) sq
     LEFT JOIN public.user_course_bridge ucb ON (((ucb.course_id = sq.course_id) AND (ucb.user_id = sq.user_id))));


ALTER TABLE public.user_course_progress_view OWNER TO dev_service_user;

--
-- Name: tempomat_calculation_data_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.tempomat_calculation_data_view AS
 SELECT ucb.user_id,
    ucb.course_id,
    ucb.required_completion_date,
    ucb.start_date,
    ucb.tempomat_mode,
    uccoev.previsioned_completion_date AS original_previsioned_completion_date,
    ucpa.total_item_count,
    ucpa.total_completed_item_count,
        CASE
            WHEN (ucb.tempomat_mode = 'light'::text) THEN (1)::numeric
            ELSE
            CASE
                WHEN (ucb.tempomat_mode = 'strict'::text) THEN (0)::numeric
                ELSE (((tav.min_value + (((tav.max_value - tav.min_value) / 10) * upav.experience)))::numeric * 0.01)
            END
        END AS tempomat_adjustment_value
   FROM (((((public.user_course_bridge ucb
     LEFT JOIN public.user_course_progress_view ucpv ON (((ucpv.course_id = ucb.course_id) AND (ucpv.user_id = ucb.user_id))))
     LEFT JOIN public.user_course_progress_actual_view ucpa ON (((ucpa.course_id = ucb.course_id) AND (ucpa.user_id = ucb.user_id))))
     LEFT JOIN public.user_course_completion_original_estimation_view uccoev ON (((uccoev.course_id = ucb.course_id) AND (uccoev.user_id = ucb.user_id))))
     LEFT JOIN public.user_prequiz_answers_view upav ON (((upav.user_id = ucb.user_id) AND (upav.course_id = ucb.course_id))))
     LEFT JOIN public.tempomat_adjustment_value tav ON (((tav.prequiz_answer_id = upav.planned_usage_answer_id) AND (tav.tempomat_mode = ucb.tempomat_mode))));


ALTER TABLE public.tempomat_calculation_data_view OWNER TO dev_service_user;

--
-- Name: user_permission_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_permission_view AS
 WITH user_assigned_permissions AS (
         SELECT u.id AS assignee_user_id,
            pab.context_company_id,
            pab.context_course_id,
            NULL::integer AS role_id,
            pab.permission_id,
            pab.id AS assignment_bridge_id
           FROM (public."user" u
             JOIN public.permission_assignment_bridge pab ON ((pab.assignee_user_id = u.id)))
        ), role_inherited_permissions AS (
         SELECT u.id AS assignee_user_id,
            rab.context_company_id,
            NULL::integer AS context_course_id,
            rpb.role_id,
            rpb.permission_id,
            NULL::integer AS assignment_bridge_id
           FROM ((public."user" u
             JOIN public.role_assignment_bridge rab ON ((rab.assignee_user_id = u.id)))
             LEFT JOIN public.role_permission_bridge rpb ON ((rpb.role_id = rab.role_id)))
        ), company_inherited_permissions AS (
         SELECT u.id AS assignee_user_id,
            cpv.context_company_id,
            cpv.context_course_id,
            cpv.role_id,
            cpv.permission_id,
            NULL::integer AS assignment_bridge_id
           FROM (public.company_permission_view cpv
             JOIN public."user" u ON ((u.company_id = cpv.assignee_company_id)))
        ), inherited_or_assigned_permissions AS (
         SELECT uap.assignee_user_id,
            uap.context_company_id,
            uap.context_course_id,
            uap.role_id,
            uap.permission_id,
            uap.assignment_bridge_id
           FROM user_assigned_permissions uap
        UNION
         SELECT rip.assignee_user_id,
            rip.context_company_id,
            rip.context_course_id,
            rip.role_id,
            rip.permission_id,
            rip.assignment_bridge_id
           FROM role_inherited_permissions rip
        UNION
         SELECT cip.assignee_user_id,
            cip.context_company_id,
            cip.context_course_id,
            cip.role_id,
            cip.permission_id,
            cip.assignment_bridge_id
           FROM company_inherited_permissions cip
        ), watch_course_permissions AS (
         SELECT cab.user_id AS assignee_user_id,
            cab.course_id AS context_course_id,
            pe.id AS permission_id
           FROM (public.course_access_bridge cab
             LEFT JOIN public.permission pe ON ((pe.code = 'WATCH_COURSE'::text)))
        ), survey_permissions AS (
         SELECT u.id AS assignee_user_id,
            pe.id AS permission_id,
            u.company_id AS context_company_id
           FROM ((public."user" u
             LEFT JOIN public.signup_completed_view scv ON ((scv.user_id = u.id)))
             LEFT JOIN public.permission pe ON ((pe.code = 'BYPASS_SURVEY'::text)))
          WHERE ((u.is_survey_required = false) OR scv.is_signup_complete)
        ), user_god_permissions AS (
         SELECT u.id AS assignee_user_id,
            co.id AS context_company_id,
            cour.id AS context_course_id,
            comm.id AS context_comment_id,
            pe.id AS permission_id
           FROM ((((public.permission pe
             LEFT JOIN public.company co ON ((pe.scope = 'COMPANY'::text)))
             LEFT JOIN public.course cour ON ((pe.scope = 'COURSE'::text)))
             LEFT JOIN public.comment comm ON ((pe.scope = 'COMMENT'::text)))
             JOIN public."user" u ON ((u.is_god = true)))
          ORDER BY u.id, co.id, cour.id, pe.id
        ), comment_permissions AS (
         SELECT co.user_id AS assignee_user_id,
            co.id AS context_comment_id,
            pe.id AS permission_id
           FROM (public.comment co
             LEFT JOIN public.permission pe ON (((pe.code = 'EDIT_COMMENT'::text) OR (pe.code = 'DELETE_COMMENT'::text))))
        ), all_permissions AS (
         SELECT cp.assignee_user_id,
            NULL::integer AS context_company_id,
            NULL::integer AS context_course_id,
            cp.context_comment_id,
            NULL::integer AS role_id,
            cp.permission_id,
            NULL::integer AS assignment_bridge_id
           FROM comment_permissions cp
        UNION
         SELECT ioa.assignee_user_id,
            ioa.context_company_id,
            ioa.context_course_id,
            NULL::integer AS context_comment_id,
            ioa.role_id,
            ioa.permission_id,
            ioa.assignment_bridge_id
           FROM inherited_or_assigned_permissions ioa
        UNION
         SELECT ugp.assignee_user_id,
            ugp.context_company_id,
            ugp.context_course_id,
            ugp.context_comment_id,
            NULL::integer AS role_id,
            ugp.permission_id,
            NULL::integer AS assignment_bridge_id
           FROM user_god_permissions ugp
        UNION
         SELECT wcp.assignee_user_id,
            NULL::integer AS context_company_id,
            wcp.context_course_id,
            NULL::integer AS context_comment_id,
            NULL::integer AS role_id,
            wcp.permission_id,
            NULL::integer AS assignment_bridge_id
           FROM watch_course_permissions wcp
        UNION
         SELECT supe.assignee_user_id,
            supe.context_company_id,
            NULL::integer AS context_course_id,
            NULL::integer AS context_comment_id,
            NULL::integer AS role_id,
            supe.permission_id,
            NULL::integer AS assignment_bridge_id
           FROM survey_permissions supe
        ), v AS (
         SELECT u.id AS assignee_user_id,
            co.id AS context_company_id,
            co.name AS context_company_name,
            ap.context_course_id,
            cd.title AS context_course_name,
            ap.context_comment_id,
            pe.id AS permission_id,
            pe.code AS permission_code,
            pe.scope AS permission_scope,
            parent_ro.id AS parent_role_id,
            parent_ro.name AS parent_role_name,
            ap.assignment_bridge_id
           FROM (((((((public."user" u
             JOIN all_permissions ap ON ((ap.assignee_user_id = u.id)))
             JOIN public.permission pe ON ((pe.id = ap.permission_id)))
             LEFT JOIN public.company co ON ((co.id = ap.context_company_id)))
             LEFT JOIN public.latest_course_version_view lcv ON ((lcv.course_id = ap.context_course_id)))
             LEFT JOIN public.course_version cv ON ((cv.id = lcv.version_id)))
             LEFT JOIN public.course_data cd ON ((cd.id = cv.course_data_id)))
             LEFT JOIN public.role parent_ro ON ((parent_ro.id = ap.role_id)))
          ORDER BY u.id, ap.context_company_id, ap.context_course_id, pe.id
        )
 SELECT v.assignee_user_id,
    v.context_company_id,
    v.context_company_name,
    v.context_course_id,
    v.context_course_name,
    v.context_comment_id,
    v.permission_id,
    v.permission_code,
    v.permission_scope,
    v.parent_role_id,
    v.parent_role_name,
    v.assignment_bridge_id
   FROM v;


ALTER TABLE public.user_permission_view OWNER TO dev_service_user;

--
-- Name: user_practise_recommendation_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_practise_recommendation_view AS
 WITH latest_given_answer_ids AS (
         SELECT max(ga.id) AS given_answer_id,
            ga.question_version_id,
            ase.user_id
           FROM (public.given_answer ga
             LEFT JOIN public.answer_session ase ON ((ase.id = ga.answer_session_id)))
          GROUP BY ga.question_version_id, ase.user_id
        ), answer_counts AS (
         SELECT vv_1.id AS video_version_id,
            count(ga.id) AS total_given_answer_count,
            sum((((ga.state)::text = 'CORRECT'::text))::integer) AS total_correct_answer_count
           FROM ((public.video_version vv_1
             LEFT JOIN public.question_version qv ON ((qv.video_version_id = vv_1.id)))
             LEFT JOIN public.given_answer ga ON ((ga.question_version_id = qv.id)))
          GROUP BY vv_1.id, ga.question_version_id
        ), video_is_recommended AS (
         SELECT vv_1.id AS video_version_id,
            ase.user_id,
            (sum((((ga.state)::text = 'CORRECT'::text))::integer) <> count(ga.id)) AS is_recommended
           FROM ((((public.video_version vv_1
             LEFT JOIN public.question_version qv ON ((qv.video_version_id = vv_1.id)))
             LEFT JOIN latest_given_answer_ids lgai ON ((lgai.question_version_id = qv.id)))
             LEFT JOIN public.given_answer ga ON ((ga.id = lgai.given_answer_id)))
             LEFT JOIN public.answer_session ase ON ((ase.id = ga.answer_session_id)))
          GROUP BY vv_1.id, ase.user_id
        )
 SELECT vv.id AS video_version_id,
    vv.video_id,
    vir.user_id,
    cv.id AS course_version_id,
    (ac.total_given_answer_count)::integer AS total_given_answer_count,
    (ac.total_correct_answer_count)::integer AS total_correct_answer_count,
    vir.is_recommended AS is_recommended_for_practise
   FROM ((((public.video_version vv
     LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)))
     LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
     LEFT JOIN video_is_recommended vir ON ((vir.video_version_id = vv.id)))
     LEFT JOIN answer_counts ac ON ((ac.video_version_id = vv.id)));


ALTER TABLE public.user_practise_recommendation_view OWNER TO dev_service_user;

--
-- Name: admin_user_courses_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.admin_user_courses_view AS
 WITH question_answer_cte AS (
         SELECT asv.user_id,
            cv_1.course_id,
            sum(asv.answered_question_count) AS answered_question_count,
            sum(
                CASE
                    WHEN (asv.answer_session_type = 'practise'::text) THEN asv.answered_question_count
                    ELSE (0)::bigint
                END) AS practise_quesiton_answer_count,
            sum(
                CASE
                    WHEN (asv.answer_session_type = 'video'::text) THEN asv.answered_question_count
                    ELSE (0)::bigint
                END) AS video_quesiton_answer_count
           FROM ((((public.given_answer ga
             LEFT JOIN public.answer_session_view asv ON ((asv.answer_session_id = ga.answer_session_id)))
             LEFT JOIN public.video_version vv ON ((vv.id = asv.video_version_id)))
             LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)))
             JOIN public.course_version cv_1 ON ((cv_1.id = mv.course_version_id)))
          GROUP BY asv.user_id, cv_1.course_id
          ORDER BY asv.user_id, cv_1.course_id
        ), avg_performance_cte AS (
         SELECT upv_1.course_id,
            avg(upv_1.performance_percentage) AS avg_performance
           FROM public.user_performance_view upv_1
          WHERE (upv_1.performance_percentage <> (0)::double precision)
          GROUP BY upv_1.course_id
        ), completed_video_count AS (
         SELECT cicv.user_id,
            cicv.course_id,
            count(cicv.video_version_id) AS completed_video_count
           FROM public.course_item_completion_view cicv
          GROUP BY cicv.user_id, cicv.course_id
        ), is_final_exam_completed_cte AS (
         SELECT cv_1.course_id,
            cic.user_id,
            (count(*) > 0) AS is_final_exam_completed
           FROM ((((public.course_item_completion_view cic
             LEFT JOIN public.exam_version ev ON ((ev.id = cic.exam_version_id)))
             LEFT JOIN public.exam_data ed ON ((ed.id = ev.exam_data_id)))
             LEFT JOIN public.module_version mv ON ((mv.id = ev.module_version_id)))
             LEFT JOIN public.course_version cv_1 ON ((cv_1.id = mv.course_version_id)))
          WHERE (ed.is_final IS TRUE)
          GROUP BY cv_1.course_id, cic.user_id
        ), correct_answer_rate_cte AS (
         SELECT cqsv.course_id,
            cqsv.user_id,
                CASE
                    WHEN (cqsv.total_answer_count > 0) THEN ((((cqsv.correct_answer_count)::double precision / (cqsv.total_answer_count)::double precision) * (100)::double precision))::integer
                    ELSE 0
                END AS correct_answer_rate
           FROM public.course_questions_success_view cqsv
        ), completed_exam_count_cte AS (
         SELECT cv_1.course_id,
            cic.user_id,
            (count(*))::integer AS completed_exam_count
           FROM ((((public.course_item_completion_view cic
             LEFT JOIN public.exam_version ev ON ((ev.id = cic.exam_version_id)))
             LEFT JOIN public.exam ex ON ((ex.id = ev.exam_id)))
             LEFT JOIN public.module_version mv ON ((mv.id = ev.module_version_id)))
             LEFT JOIN public.course_version cv_1 ON ((cv_1.id = mv.course_version_id)))
          WHERE ((ex.is_pretest = false) AND (ex.is_signup = false))
          GROUP BY cv_1.course_id, cic.user_id
        ), recommended_videos_for_practise_cte AS (
         SELECT cv_1.course_id,
            uprv.user_id,
            (count(uprv.total_given_answer_count))::integer AS recommended_videos_for_practise_count
           FROM ((public.user_practise_recommendation_view uprv
             LEFT JOIN public.course_version cv_1 ON ((cv_1.id = uprv.course_version_id)))
             LEFT JOIN public.course_state_view cosv_1 ON (((cosv_1.course_id = cv_1.course_id) AND (cosv_1.user_id = uprv.user_id))))
          WHERE ((uprv.total_given_answer_count = 3) AND (uprv.is_recommended_for_practise IS TRUE) AND (cosv_1.in_progress IS TRUE))
          GROUP BY cv_1.course_id, uprv.user_id
        )
 SELECT u.id AS user_id,
    co.id AS course_id,
    (upev.assignee_user_id IS NOT NULL) AS is_accessible,
    (ucb.id IS NOT NULL) AS is_assigned,
    cv.id AS course_version_id,
    cd.title,
    sf.file_path AS cover_file_path,
    cosv.start_date,
    ucpav.completed_percentage AS course_progress_percentage,
    cvc.completed_video_count,
    cstv.total_spent_seconds,
    COALESCE(qac.video_quesiton_answer_count, (0)::numeric) AS answered_video_question_count,
    COALESCE(qac.practise_quesiton_answer_count, (0)::numeric) AS answered_practise_question_count,
    tcdv.required_completion_date,
    tcdv.tempomat_adjustment_value,
    tcdv.tempomat_mode,
    tcdv.original_previsioned_completion_date,
    tcdv.total_item_count,
    tcdv.total_completed_item_count,
    (upv.performance_percentage - apc.avg_performance) AS difference_from_average_performance_percentage,
    upv.performance_percentage,
    apc.avg_performance,
    ifecc.is_final_exam_completed,
    carc.correct_answer_rate,
    cecc.completed_exam_count,
    rvfpc.recommended_videos_for_practise_count,
    ((ucb.stage_name <> 'assigned'::text) AND (ucb.stage_name IS NOT NULL)) AS is_tempomat_ready
   FROM ((((((((((((((((((((public."user" u
     JOIN public.course_access_bridge cab ON ((cab.company_id = u.company_id)))
     LEFT JOIN public.course co ON ((co.id = cab.course_id)))
     LEFT JOIN public.user_permission_view upev ON (((upev.assignee_user_id = u.id) AND (upev.context_course_id = co.id) AND (upev.permission_code = 'WATCH_COURSE'::text))))
     LEFT JOIN public.user_course_bridge ucb ON (((ucb.course_id = co.id) AND (ucb.user_id = u.id))))
     LEFT JOIN public.latest_course_version_view lcvv ON ((lcvv.course_id = co.id)))
     LEFT JOIN public.course_version cv ON ((cv.id = lcvv.version_id)))
     LEFT JOIN public.course_data cd ON ((cd.id = cv.course_data_id)))
     LEFT JOIN public.user_course_progress_actual_view ucpav ON (((ucpav.user_id = u.id) AND (ucpav.course_id = co.id))))
     LEFT JOIN public.course_state_view cosv ON (((cosv.course_id = co.id) AND (cosv.user_id = u.id))))
     LEFT JOIN public.course_spent_time_view cstv ON (((cstv.user_id = u.id) AND (cstv.course_id = co.id))))
     LEFT JOIN public.tempomat_calculation_data_view tcdv ON (((tcdv.user_id = u.id) AND (tcdv.course_id = co.id))))
     LEFT JOIN public.storage_file sf ON ((sf.id = cd.cover_file_id)))
     LEFT JOIN question_answer_cte qac ON (((qac.course_id = co.id) AND (qac.user_id = u.id))))
     LEFT JOIN public.user_performance_view upv ON (((upv.user_id = u.id) AND (upv.course_id = co.id))))
     LEFT JOIN completed_video_count cvc ON (((cvc.user_id = u.id) AND (cvc.course_id = co.id))))
     LEFT JOIN avg_performance_cte apc ON ((apc.course_id = co.id)))
     LEFT JOIN is_final_exam_completed_cte ifecc ON (((ifecc.course_id = co.id) AND (ifecc.user_id = u.id))))
     LEFT JOIN correct_answer_rate_cte carc ON (((carc.course_id = co.id) AND (carc.user_id = u.id))))
     LEFT JOIN completed_exam_count_cte cecc ON (((cecc.course_id = co.id) AND (cecc.user_id = u.id))))
     LEFT JOIN recommended_videos_for_practise_cte rvfpc ON (((rvfpc.course_id = co.id) AND (rvfpc.user_id = u.id))))
  ORDER BY u.id, (ucb.id IS NULL), co.id;


ALTER TABLE public.admin_user_courses_view OWNER TO dev_service_user;

