CREATE VIEW public.assignable_permission_view AS
 WITH permissions AS (
         SELECT upv.assignee_user_id,
            upv.context_company_id,
            pe.id AS permission_id,
            pe.code AS permission_code,
            pe.scope AS permission_scope
           FROM (public.permission pe
             JOIN public.user_permission_view upv ON ((((upv.permission_code = 'ASSIGN_COMPANY_PERMISSIONS'::text) AND (pe.scope = 'COMPANY'::text)) OR ((upv.permission_code = 'ASSIGN_GLOBAL_PERMISSIONS'::text) AND (pe.scope = 'USER'::text)) OR ((upv.permission_code = 'ASSIGN_COURSE_PERMISSIONS'::text) AND (pe.scope = 'COURSE'::text)))))
        )
 SELECT permissions.assignee_user_id,
    permissions.context_company_id,
    permissions.permission_id,
    permissions.permission_code,
    permissions.permission_scope
   FROM permissions
  ORDER BY permissions.assignee_user_id, permissions.permission_scope, permissions.context_company_id, permissions.permission_id;


ALTER TABLE public.assignable_permission_view OWNER TO dev_service_user;

--
-- Name: user_role_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_role_view AS
 WITH god_roles AS (
         SELECT u_1.id AS assignee_user_id,
            NULL::integer AS assignment_bridge_id,
            co_1.id AS context_company_id,
            ro_1.id AS role_id,
            false AS is_inherited
           FROM ((public.company co_1
             LEFT JOIN public.role ro_1 ON (((ro_1.is_custom = false) OR (ro_1.company_id = co_1.id))))
             JOIN public."user" u_1 ON (u_1.is_god))
        ), assigned_roles AS (
         SELECT u_1.id AS assignee_user_id,
            rab.id AS assignment_bridge_id,
            rab.context_company_id,
            rab.role_id,
            false AS is_inherited
           FROM (public."user" u_1
             JOIN public.role_assignment_bridge rab ON ((rab.assignee_user_id = u_1.id)))
        ), comp_inherited_roles AS (
         SELECT u_1.id AS assignee_user_id,
            rab.id AS assignment_bridge_id,
            rab.context_company_id,
            rab.role_id,
            true AS is_inherited
           FROM (public."user" u_1
             JOIN public.role_assignment_bridge rab ON ((rab.assignee_company_id = u_1.company_id)))
        ), all_roles AS (
         SELECT god_roles.assignee_user_id,
            god_roles.assignment_bridge_id,
            god_roles.context_company_id,
            god_roles.role_id,
            god_roles.is_inherited
           FROM god_roles
        UNION
         SELECT assigned_roles.assignee_user_id,
            assigned_roles.assignment_bridge_id,
            assigned_roles.context_company_id,
            assigned_roles.role_id,
            assigned_roles.is_inherited
           FROM assigned_roles
        UNION
         SELECT comp_inherited_roles.assignee_user_id,
            comp_inherited_roles.assignment_bridge_id,
            comp_inherited_roles.context_company_id,
            comp_inherited_roles.role_id,
            comp_inherited_roles.is_inherited
           FROM comp_inherited_roles
        )
 SELECT all_roles.assignment_bridge_id,
    co.id AS context_company_id,
    co.name AS context_company_name,
    ro.id AS role_id,
    ro.name AS role_name,
    u.id AS assignee_user_id,
    all_roles.is_inherited,
    pe.id AS permission_id,
    pe.code AS permission_code
   FROM (((((all_roles
     LEFT JOIN public.company co ON ((co.id = all_roles.context_company_id)))
     LEFT JOIN public.role ro ON ((ro.id = all_roles.role_id)))
     LEFT JOIN public."user" u ON ((u.id = all_roles.assignee_user_id)))
     LEFT JOIN public.role_permission_bridge rpb ON ((rpb.role_id = all_roles.role_id)))
     LEFT JOIN public.permission pe ON ((pe.id = rpb.permission_id)))
  ORDER BY u.id, co.id, ro.id;


ALTER TABLE public.user_role_view OWNER TO dev_service_user;

--
-- Name: assignable_role_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.assignable_role_view AS
 WITH assignable_role_ids AS (
         SELECT u.id AS assigner_user_id,
            upv.context_company_id,
            ro.id AS role_id,
            ro.name AS role_name
           FROM ((public."user" u
             LEFT JOIN public.user_permission_view upv ON (((upv.assignee_user_id = u.id) AND ((upv.permission_code = 'ASSIGN_PREDEFINED_ROLES'::text) OR (upv.permission_code = 'ASSIGN_CUSTOM_ROLES'::text)))))
             JOIN public.role ro ON ((((ro.is_custom = false) AND (upv.permission_code = 'ASSIGN_PREDEFINED_ROLES'::text)) OR ((ro.company_id = upv.context_company_id) AND (upv.permission_code = 'ASSIGN_CUSTOM_ROLES'::text)))))
          ORDER BY u.id, upv.context_company_id, ro.id
        ), roles AS (
         SELECT assigner_u.id AS assigner_user_id,
            assignee_u.id AS assignee_user_id,
            co.id AS context_company_id,
            co.name AS context_company_name,
            ro.id AS role_id,
            ro.name AS role_name,
            ro.is_custom,
                CASE
                    WHEN ro.is_custom THEN co.id
                    ELSE NULL::integer
                END AS owner_company_id,
                CASE
                    WHEN ro.is_custom THEN co.name
                    ELSE NULL::character varying
                END AS owner_company_name,
            (urv.role_id IS NOT NULL) AS is_assigned,
                CASE
                    WHEN assignee_u.is_god THEN false
                    ELSE (ari.role_id IS NOT NULL)
                END AS can_assign
           FROM (((((public."user" assigner_u
             CROSS JOIN public."user" assignee_u)
             CROSS JOIN public.company co)
             LEFT JOIN public.role ro ON (((ro.is_custom = false) OR (ro.company_id = co.id))))
             LEFT JOIN public.user_role_view urv ON (((urv.assignee_user_id = assignee_u.id) AND (urv.role_id = ro.id) AND ((urv.context_company_id IS NULL) OR (urv.context_company_id = co.id)))))
             LEFT JOIN assignable_role_ids ari ON (((ari.assigner_user_id = assigner_u.id) AND (ari.role_id = ro.id) AND (ari.context_company_id = co.id))))
          ORDER BY assigner_u.id, assignee_u.id, co.id, ro.id
        ), perm_join AS (
         SELECT ro.assigner_user_id,
            ro.assignee_user_id,
            ro.context_company_id,
            ro.context_company_name,
            ro.role_id,
            ro.role_name,
            ro.is_custom,
            ro.owner_company_id,
            ro.owner_company_name,
            ro.is_assigned,
            ro.can_assign,
            pe.id AS permission_id,
            pe.code AS permission_code
           FROM ((roles ro
             LEFT JOIN public.role_permission_bridge rpb ON ((rpb.role_id = ro.role_id)))
             LEFT JOIN public.permission pe ON ((pe.id = rpb.permission_id)))
          ORDER BY ro.assigner_user_id, ro.assignee_user_id, ro.context_company_id, ro.role_id, rpb.permission_id
        )
 SELECT perm_join.assigner_user_id,
    perm_join.assignee_user_id,
    perm_join.context_company_id,
    perm_join.context_company_name,
    perm_join.role_id,
    perm_join.role_name,
    perm_join.is_custom,
    perm_join.owner_company_id,
    perm_join.owner_company_name,
    perm_join.is_assigned,
    perm_join.can_assign,
    perm_join.permission_id,
    perm_join.permission_code
   FROM perm_join;


