CREATE TABLE public.coin_transaction (
    id integer NOT NULL,
    creation_date timestamp with time zone DEFAULT now() NOT NULL,
    amount integer NOT NULL,
    is_gifted boolean DEFAULT false NOT NULL,
    user_id integer NOT NULL,
    activity_session_id integer,
    video_id integer,
    given_answer_id integer,
    given_answer_streak_id integer,
    activity_streak_id integer,
    shop_item_id integer,
    CONSTRAINT coin_transaction_valid_relation_enforce_constraint CHECK (((activity_session_id IS NOT NULL) OR (video_id IS NOT NULL) OR (given_answer_id IS NOT NULL) OR (given_answer_streak_id IS NOT NULL) OR (activity_streak_id IS NOT NULL) OR (shop_item_id IS NOT NULL) OR is_gifted))
