--
-- Name: shop_item_stateful_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.shop_item_stateful_view AS
 SELECT sq.id,
    sq.user_id,
    sq.purchase_count,
    sq.course_id,
    sq.name,
    sq.purchase_limit,
    sq.coin_price,
    sq.currency_price,
    sq.shop_item_category_id,
    sq.shop_item_category_name,
    sq.details_url,
    sq.cover_file_path,
        CASE
            WHEN (sq.course_id IS NULL) THEN (sq.purchase_count < sq.purchase_limit)
            ELSE (sq.purchase_count = 0)
        END AS can_purchase
   FROM ( SELECT si.id,
            u.id AS user_id,
            ( SELECT (count(ct.id))::integer AS count
                   FROM public.coin_transaction ct
                  WHERE ((ct.shop_item_id = si.id) AND (ct.user_id = u.id))) AS purchase_count,
            si.course_id,
                CASE
                    WHEN (cv.id IS NULL) THEN (si.name)::character varying
                    ELSE cd.title
                END AS name,
            si.purchase_limit,
            si.coin_price,
            si.currency_price,
            sic.id AS shop_item_category_id,
            sic.name AS shop_item_category_name,
            si.details_url,
                CASE
                    WHEN (cv.id IS NULL) THEN sisf.file_path
                    ELSE cosf.file_path
                END AS cover_file_path
           FROM ((((((public.shop_item si
             LEFT JOIN public."user" u ON ((1 = 1)))
             LEFT JOIN public.course_version cv ON ((cv.id = si.course_id)))
             LEFT JOIN public.course_data cd ON ((cd.id = cv.course_data_id)))
             LEFT JOIN public.shop_item_category sic ON ((sic.id = si.shop_item_category_id)))
             LEFT JOIN public.storage_file sisf ON ((sisf.id = si.cover_file_id)))
             LEFT JOIN public.storage_file cosf ON ((cosf.id = cd.cover_file_id)))
          ORDER BY u.id, si.id) sq;


ALTER TABLE public.shop_item_stateful_view OWNER TO dev_service_user;

--
-- Name: coin_transaction_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.coin_transaction_view AS
 SELECT ca.id,
    ca.user_id,
    ca.creation_date,
    ca.amount,
    vd.title AS video_title,
    qd.question_text,
    sisv.name AS shop_item_name,
        CASE
            WHEN (ca.activity_session_id IS NOT NULL) THEN 'activity'::text
            ELSE
            CASE
                WHEN (ca.video_id IS NOT NULL) THEN 'video_watched'::text
                ELSE
                CASE
                    WHEN (ca.given_answer_id IS NOT NULL) THEN 'correct_answer'::text
                    ELSE
                    CASE
                        WHEN (ca.given_answer_streak_id IS NOT NULL) THEN 'answer_streak'::text
                        ELSE
                        CASE
                            WHEN (ca.activity_streak_id IS NOT NULL) THEN 'activity_streak'::text
                            ELSE
                            CASE
                                WHEN (ca.shop_item_id IS NOT NULL) THEN 'shop_item_purchase'::text
                                ELSE
                                CASE
                                    WHEN ca.is_gifted THEN 'gifted'::text
                                    ELSE 'unknown'::text
                                END
                            END
                        END
                    END
                END
            END
        END AS reason
   FROM (((((((public.coin_transaction ca
     LEFT JOIN public.video v ON ((v.id = ca.video_id)))
     LEFT JOIN public.video_version vv ON ((vv.video_id = v.id)))
     LEFT JOIN public.video_data vd ON ((vd.id = vv.video_data_id)))
     LEFT JOIN public.given_answer ga ON ((ga.id = ca.given_answer_id)))
     LEFT JOIN public.question_version qv ON ((qv.id = ga.question_version_id)))
     LEFT JOIN public.question_data qd ON ((qd.id = qv.question_data_id)))
     LEFT JOIN public.shop_item_stateful_view sisv ON (((sisv.id = ca.shop_item_id) AND (sisv.user_id = ca.user_id))))
  ORDER BY ca.creation_date DESC;


ALTER TABLE public.coin_transaction_view OWNER TO dev_service_user;

