--
-- Name: comment_list_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.comment_list_view AS
 SELECT
        CASE
            WHEN (co.is_anonymous IS NOT TRUE) THEN concat(all_user.last_name, ' ', all_user.first_name)
            ELSE NULL::text
        END AS full_name,
    sf.file_path AS avatar_url,
    co.id,
    co.text AS comment_text,
    co.creation_date,
    vv.video_id,
    co.parent_comment_id,
    co.is_anonymous,
    co.is_question,
    all_user.id AS user_id,
    owner_user.id AS current_user_id,
    ((l.deletion_date IS NULL) AND (l.user_id IS NOT NULL)) AS is_like,
    (( SELECT count(1) AS count
           FROM public."like" l_1
          WHERE ((l_1.comment_id = co.id) AND (l_1.deletion_date IS NULL))))::integer AS comment_like_count,
        CASE
            WHEN (co.parent_comment_id IS NULL) THEN co.id
            ELSE co.parent_comment_id
        END AS thread_id
   FROM (((((public.comment co
     LEFT JOIN public."user" all_user ON ((all_user.id = co.user_id)))
     LEFT JOIN public.storage_file sf ON ((all_user.avatar_file_id = sf.id)))
     LEFT JOIN public.video_version vv ON ((vv.id = co.video_version_id)))
     CROSS JOIN public."user" owner_user)
     LEFT JOIN public."like" l ON (((l.comment_id = co.id) AND (l.user_id = owner_user.id) AND (l.deletion_date IS NULL))))
  ORDER BY
        CASE
            WHEN (co.parent_comment_id IS NULL) THEN co.id
            ELSE co.parent_comment_id
        END, co.creation_date, co.parent_comment_id DESC;


ALTER TABLE public.comment_list_view OWNER TO dev_service_user;

