    (co.deletion_date IS NOT NULL) AS is_deleted,
    cv.id AS course_version_id,
    (cab.id IS NOT NULL) AS is_assigned,
    (pab.id IS NOT NULL) AS is_default,
    cover_file.file_path AS cover_file_path,
    cd.title
   FROM ((((((((public.company com
     CROSS JOIN public.course co)
     LEFT JOIN public.latest_course_version_view lcvv ON ((lcvv.course_id = co.id)))
     LEFT JOIN public.course_version cv ON ((cv.id = lcvv.version_id)))
     LEFT JOIN public.course_access_bridge cab ON (((cab.course_id = co.id) AND (cab.company_id = com.id))))
     LEFT JOIN public.course_data cd ON ((cd.id = cv.course_data_id)))
     LEFT JOIN public.storage_file cover_file ON ((cover_file.id = cd.cover_file_id)))
     LEFT JOIN public.permission pe ON ((pe.code = 'WATCH_COURSE'::text)))
     LEFT JOIN public.permission_assignment_bridge pab ON (((pab.assignee_company_id = com.id) AND (pab.permission_id = pe.id) AND (pab.context_course_id = co.id))))
  ORDER BY com.id, (cab.id IS NOT NULL) DESC, co.id;


