--

CREATE VIEW public.course_admin_short_view AS
 WITH exam_count AS (
         SELECT count(ev.id) AS exam_count,
            mv.course_version_id
           FROM (public.exam_version ev
             LEFT JOIN public.module_version mv ON ((mv.id = ev.module_version_id)))
          GROUP BY mv.course_version_id
        )
 SELECT lcvv.course_id,
    cd.title,
    (co.deletion_date IS NOT NULL) AS is_deleted,
    cc.id AS category_id,
    cc.name AS category_name,
    scc.id AS sub_category_id,
    scc.name AS sub_category_name,
    u.id AS teacher_id,
    u.first_name AS teacher_first_name,
    u.last_name AS teacher_last_name,
    sf.file_path AS cover_file_path,
    cvcv.video_count,
    ec.exam_count
   FROM (((((((((public.latest_course_version_view lcvv
     LEFT JOIN public.course_version cv ON ((cv.id = lcvv.version_id)))
     LEFT JOIN public.course co ON ((co.id = cv.course_id)))
     LEFT JOIN public.course_data cd ON ((cd.id = cv.course_data_id)))
     LEFT JOIN public.storage_file sf ON ((sf.id = cd.cover_file_id)))
     LEFT JOIN public."user" u ON ((u.id = cd.teacher_id)))
     LEFT JOIN public.course_category cc ON ((cc.id = cd.category_id)))
     LEFT JOIN public.course_category scc ON ((scc.id = cd.sub_category_id)))
     LEFT JOIN public.course_video_count_view cvcv ON ((cvcv.course_version_id = lcvv.version_id)))
     LEFT JOIN exam_count ec ON ((ec.course_version_id = lcvv.version_id)))
  ORDER BY lcvv.course_id;


ALTER TABLE public.course_admin_short_view OWNER TO dev_service_user;

--
-- Name: course_admin_content_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.course_admin_content_view AS
 WITH question_version_answer_counts AS (
         SELECT qv.id AS question_version_id,
            count(av.id) AS answer_count,
            COALESCE(sum((ad.is_correct)::integer), (0)::bigint) AS correct_answer_count
           FROM ((public.question_version qv
             LEFT JOIN public.answer_version av ON ((av.question_version_id = qv.id)))
             LEFT JOIN public.answer_data ad ON ((ad.id = av.answer_data_id)))
          GROUP BY qv.id, qv.video_version_id, qv.exam_version_id
        ), questions AS (
         SELECT qv.id AS question_version_id,
            qd.question_text,
            qv.video_version_id,
            qv.exam_version_id,
            qvac.answer_count,
            qvac.correct_answer_count,
            (qvac.answer_count = 0) AS issue_answers_missing,
            (qvac.correct_answer_count = 0) AS issue_correct_answers_missing
           FROM ((((public.question_version qv
             LEFT JOIN public.question_data qd ON ((qd.id = qv.question_data_id)))
             LEFT JOIN public.answer_version av ON ((av.question_version_id = qv.id)))
             LEFT JOIN public.answer_data ad ON ((ad.id = av.answer_data_id)))
             LEFT JOIN question_version_answer_counts qvac ON ((qvac.question_version_id = qv.id)))
        ), items AS (
         SELECT sq.video_version_id,
            sq.exam_version_id,
            sq.question_count,
            (sq.question_count = 0) AS issue_questions_missing,
            sq.question_issues
           FROM ( SELECT civ_1.video_version_id,
                    civ_1.exam_version_id,
                    count(qs.question_version_id) AS question_count,
                    string_agg(((qs.question_text)::text ||
                        CASE
                            WHEN qs.issue_answers_missing THEN ': ans_miss'::text
                            ELSE ': corr_ans_miss'::text
                        END), chr(10)) FILTER (WHERE (qs.issue_answers_missing OR qs.issue_correct_answers_missing)) AS question_issues,
                    COALESCE(sum((qs.issue_answers_missing)::integer), (0)::bigint) AS missing_answers_issues_count,
                    COALESCE(sum((qs.issue_correct_answers_missing)::integer), (0)::bigint) AS missing_correct_answers_count
                   FROM (public.course_item_view civ_1
                     LEFT JOIN questions qs ON (((qs.video_version_id = civ_1.video_version_id) OR (qs.exam_version_id = civ_1.exam_version_id))))
                  GROUP BY civ_1.video_version_id, civ_1.exam_version_id) sq
          ORDER BY sq.question_count DESC
        )
 SELECT casv.course_id,
    lcvv.version_id AS course_version_id,
    civ.module_name,
    civ.module_order_index,
    civ.module_version_id,
    civ.video_version_id,
    civ.exam_version_id,
    civ.item_order_index,
    civ.item_title,
    civ.item_subtitle,
    civ.item_type,
    civ.version_code,
    concat_ws(chr(10),
        CASE
            WHEN it.issue_questions_missing THEN 'questions_missing'::text
            ELSE NULL::text
        END, it.question_issues) AS errors,
    concat_ws(chr(10),
        CASE
            WHEN ((civ.item_type = 'video'::text) AND (vd.video_file_length_seconds > (480)::double precision)) THEN 'video_too_long'::text
            ELSE NULL::text
        END) AS warnings,
    vd.video_file_length_seconds AS video_length
   FROM (((((public.course_admin_short_view casv
     LEFT JOIN public.latest_course_version_view lcvv ON ((lcvv.course_id = casv.course_id)))
     LEFT JOIN public.course_item_view civ ON ((civ.course_version_id = lcvv.version_id)))
     LEFT JOIN items it ON (((it.video_version_id = civ.video_version_id) OR (it.exam_version_id = civ.exam_version_id))))
     LEFT JOIN public.video_version vv ON ((vv.id = it.video_version_id)))
     LEFT JOIN public.video_data vd ON ((vd.id = vv.video_data_id)))
  ORDER BY casv.course_id, civ.module_order_index, civ.item_order_index;


ALTER TABLE public.course_admin_content_view OWNER TO dev_service_user;

