            esv.answer_session_id,
            esv.exam_score,
            (row_number() OVER (PARTITION BY esv.user_id, ev.exam_id ORDER BY esv.exam_score DESC) = 1) AS is_highest_score
           FROM (public.exam_score_view esv
             LEFT JOIN public.exam_version ev ON ((ev.id = esv.exam_version_id)))) rns
  WHERE rns.is_highest_score;


