--
-- Name: playlist_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.playlist_view AS
 WITH all_items_cte AS (
         SELECT cv.course_id,
            cv.id AS course_version_id,
            mv.module_id,
            uni.video_version_id,
            uni.exam_version_id
           FROM ((( SELECT vv.module_version_id,
                    vv.id AS video_version_id,
                    NULL::integer AS exam_version_id
                   FROM public.video_version vv
                UNION
                 SELECT ev.module_version_id,
                    NULL::integer AS video_version_id,
                    ev.id AS exam_version_id
                   FROM public.exam_version ev) uni
             LEFT JOIN public.module_version mv ON ((mv.id = uni.module_version_id)))
             LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
          ORDER BY cv.course_id, cv.id
        ), latest_items_cte AS (
         SELECT aic.course_id,
            aic.course_version_id,
            aic.module_id,
            aic.video_version_id,
            aic.exam_version_id
           FROM (all_items_cte aic
             JOIN public.latest_course_version_view lcvi ON ((lcvi.version_id = aic.course_version_id)))
        ), latest_items_with_codes_cte AS (
         SELECT lcvi.course_id,
            civ.course_version_id,
            civ.module_name,
            civ.module_order_index,
            civ.module_version_id,
            civ.module_id,
            civ.video_version_id,
            civ.video_id,
            civ.exam_version_id,
            civ.exam_id,
            civ.item_order_index,
            civ.item_title,
            civ.item_subtitle,
            civ.item_type,
            civ.version_code,
            ( SELECT encode(((lic.module_id || '@module'::text))::bytea, 'base64'::text) AS encode) AS module_code,
                CASE
                    WHEN (civ.video_id IS NULL) THEN ( SELECT encode(((civ.exam_id || '@exam'::text))::bytea, 'base64'::text) AS encode)
                    ELSE ( SELECT encode(((civ.video_id || '@video'::text))::bytea, 'base64'::text) AS encode)
                END AS playlist_item_code
           FROM ((latest_items_cte lic
             JOIN public.latest_course_version_view lcvi ON ((lcvi.version_id = lic.course_version_id)))
             JOIN public.course_item_view civ ON ((((civ.exam_version_id = lic.exam_version_id) OR (civ.video_version_id = lic.video_version_id)) AND (civ.item_type <> 'pretest'::text))))
        )
 SELECT latest_items_with_codes_cte.course_id,
    latest_items_with_codes_cte.course_version_id,
    latest_items_with_codes_cte.module_name,
    latest_items_with_codes_cte.module_order_index,
    latest_items_with_codes_cte.module_version_id,
    latest_items_with_codes_cte.module_id,
    latest_items_with_codes_cte.video_version_id,
    latest_items_with_codes_cte.video_id,
    latest_items_with_codes_cte.exam_version_id,
    latest_items_with_codes_cte.exam_id,
    latest_items_with_codes_cte.item_order_index,
    latest_items_with_codes_cte.item_title,
    latest_items_with_codes_cte.item_subtitle,
    latest_items_with_codes_cte.item_type,
    latest_items_with_codes_cte.version_code,
    latest_items_with_codes_cte.module_code,
    latest_items_with_codes_cte.playlist_item_code
   FROM latest_items_with_codes_cte
  ORDER BY latest_items_with_codes_cte.course_id, latest_items_with_codes_cte.module_order_index, latest_items_with_codes_cte.item_order_index;


ALTER TABLE public.playlist_view OWNER TO dev_service_user;

--
-- Name: user_playlist_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_playlist_view AS
 WITH items_with_user AS (
         SELECT ucb.user_id,
            ucb.course_id,
            civ.module_order_index,
            civ.item_order_index,
            civ.video_version_id,
            civ.exam_version_id,
            civ.item_title,
            civ.course_version_id,
            civ.video_id,
            civ.exam_id,
            civ.module_version_id,
            civ.module_id,
            civ.module_name,
            civ.module_code,
            civ.item_type,
            civ.item_subtitle,
            civ.playlist_item_code,
            (ucb.current_item_code = civ.module_code) AS module_is_current,
            esv.score_percentage,
            (uprv.is_recommended_for_practise IS TRUE) AS is_recommended_for_practise,
                CASE
                    WHEN (ucb.current_item_code = civ.playlist_item_code) THEN 'current'::text
                    WHEN ((vc.completion_date IS NOT NULL) OR (ec.completion_date IS NOT NULL)) THEN 'completed'::text
                    WHEN (ucb.course_mode = 'advanced'::text) THEN 'available'::text
                    WHEN ((civ.item_order_index = 0) AND (civ.module_order_index = 1)) THEN 'available'::text
                    WHEN (lag(vc.completion_date, 1) OVER (PARTITION BY civ.course_version_id ORDER BY civ.module_order_index, civ.item_order_index) IS NOT NULL) THEN 'available'::text
                    ELSE 'locked'::text
                END AS item_state
           FROM (((((((public.playlist_view civ
             LEFT JOIN public.course_version cv ON ((cv.id = civ.course_version_id)))
             JOIN public.user_course_bridge ucb ON ((ucb.course_id = cv.course_id)))
             LEFT JOIN public.exam_highest_score_answer_session_view ehsasv ON (((ehsasv.exam_id = civ.exam_id) AND (ehsasv.user_id = ucb.user_id))))
             LEFT JOIN public.exam_score_view esv ON ((esv.answer_session_id = ehsasv.answer_session_id)))
             LEFT JOIN public.video_completion vc ON (((vc.video_version_id = civ.video_version_id) AND (vc.user_id = ucb.user_id))))
             LEFT JOIN public.exam_completion ec ON ((ec.answer_session_id = ehsasv.answer_session_id)))
             LEFT JOIN public.user_practise_recommendation_view uprv ON (((uprv.video_version_id = civ.video_version_id) AND (uprv.user_id = ucb.user_id))))
        )
 SELECT items_with_user.user_id,
    items_with_user.course_id,
    items_with_user.module_order_index,
    items_with_user.item_order_index,
    items_with_user.video_version_id,
    items_with_user.exam_version_id,
    items_with_user.item_title,
    items_with_user.course_version_id,
    items_with_user.video_id,
    items_with_user.exam_id,
    items_with_user.module_version_id,
    items_with_user.module_id,
    items_with_user.module_name,
    items_with_user.module_code,
    items_with_user.item_type,
    items_with_user.item_subtitle,
    items_with_user.playlist_item_code,
    items_with_user.module_is_current,
    items_with_user.score_percentage,
    items_with_user.is_recommended_for_practise,
    items_with_user.item_state
   FROM items_with_user
  ORDER BY items_with_user.user_id, items_with_user.course_id, items_with_user.module_order_index, items_with_user.item_order_index;


ALTER TABLE public.user_playlist_view OWNER TO dev_service_user;

