CREATE VIEW public.course_all_items_completed_view AS
 SELECT sq.course_id,
    sq.course_version_id,
    sq.user_id
   FROM ( SELECT cipv.course_id,
            cipv.course_version_id,
            cipv.user_id,
            count(cipv.course_id) AS all_item_count,
            sum(
                CASE
                    WHEN (cipv.item_state = 'completed'::text) THEN 1
                    ELSE 0
                END) AS completed_count
           FROM public.user_playlist_view cipv
          GROUP BY cipv.course_id, cipv.user_id, cipv.course_version_id) sq
  WHERE (sq.completed_count = sq.all_item_count);


