--
-- Name: course_details_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.course_details_view AS
 SELECT co.id AS course_id,
    u.id AS user_id,
    cd.title,
    cd.short_description,
    cd.description,
    cd.difficulty,
    cd.benchmark,
    cd.previously_completed_count,
    cd.language AS language_name,
    cd.technical_requirements,
    cd.skill_benefits,
    cd.visibility,
    cd.human_skill_benefits,
    cd.human_skill_benefits_description,
    cd.modification_date,
    ucb.current_item_code,
    ucb.stage_name,
    cc.id AS category_id,
    cc.name AS category_name,
    scc.id AS sub_category_id,
    scc.name AS sub_category_name,
    tuser.id AS teacher_id,
    tuser.first_name AS teacher_first_name,
    tuser.last_name AS teacher_last_name,
    tinfo.skills AS teacher_skills,
    tinfo.course_count AS teacher_course_count,
    tinfo.student_count AS teacher_student_count,
    tinfo.video_count AS teacher_video_count,
    tinfo.rating AS teacher_rating,
    tinfo.description AS teacher_description,
    tinfo.badges AS teacher_badges,
    tavatarsf.file_path AS teacher_avatar_file_path,
    sf.file_path AS cover_file_path,
    ( SELECT cvcv.video_count
           FROM public.course_video_count_view cvcv
          WHERE (cvcv.course_version_id = cv.id)) AS total_video_count,
    ( SELECT cvlv.sum_length_seconds
           FROM public.course_video_length_view cvlv
          WHERE (cvlv.course_version_id = cv.id)) AS total_video_sum_length_seconds,
    ( SELECT (COALESCE(count(mo.id), (0)::bigint))::integer AS "coalesce"
           FROM (((public.module mo
             LEFT JOIN public.module_version mv ON ((mv.id = mo.id)))
             LEFT JOIN public.course_version cv_1 ON ((cv_1.id = mv.course_version_id)))
             LEFT JOIN public.course lco ON ((lco.id = cv_1.course_id)))
          WHERE (lco.id = co.id)) AS total_module_count,
    ( SELECT (COALESCE(count(qv.id), (0)::bigint))::integer AS "coalesce"
           FROM (((((public.video v
             LEFT JOIN public.video_version vv ON ((vv.video_id = v.id)))
             LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)))
             LEFT JOIN public.course_version cv_1 ON ((cv_1.id = mv.course_version_id)))
             LEFT JOIN public.course lco ON ((lco.id = cv_1.course_id)))
             LEFT JOIN public.question_version qv ON ((qv.video_version_id = vv.id)))
          WHERE (lco.id = co.id)) AS total_video_question_count,
    true AS can_start_course
   FROM (((((((((((public.course co
     LEFT JOIN public.latest_course_version_view lcvv ON ((lcvv.course_id = co.id)))
     LEFT JOIN public.course_version cv ON ((cv.id = lcvv.version_id)))
     LEFT JOIN public.course_data cd ON ((cd.id = cv.course_data_id)))
     CROSS JOIN public."user" u)
     LEFT JOIN public.storage_file sf ON ((sf.id = cd.cover_file_id)))
     LEFT JOIN public."user" tuser ON ((tuser.id = cd.teacher_id)))
     LEFT JOIN public.storage_file tavatarsf ON ((tavatarsf.id = tuser.avatar_file_id)))
     LEFT JOIN public.teacher_info tinfo ON ((tinfo.user_id = tuser.id)))
     LEFT JOIN public.course_category cc ON ((cc.id = cd.category_id)))
     LEFT JOIN public.user_course_bridge ucb ON (((ucb.user_id = u.id) AND (ucb.course_id = cv.course_id))))
     LEFT JOIN public.course_category scc ON ((scc.id = cd.sub_category_id)))
  ORDER BY u.id, co.id;


