--
-- Name: daily_tip_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.daily_tip_view AS
 WITH user_trait_choices AS (
         SELECT ptv.user_id,
            ptv.trait_category_id,
            (ptv.max_score > ptv.min_score) AS is_max
           FROM public.personality_trait_view ptv
        )
 SELECT dt.id AS daily_tip_id,
    u.id AS user_id,
    dt.description,
    dt.personality_trait_category_id,
    sf.file_path AS video_file_path,
    latest_occurance.latest_creation_date AS last_occurrence_date,
    (latest_occurance.latest_creation_date IS NULL) AS is_new,
    (NOT ((latest_occurance.latest_creation_date)::date IS DISTINCT FROM (now())::date)) AS is_current_tip,
    dt.is_max AS tip_is_max,
    utc.is_max AS user_choice_in_category_is_max
   FROM ((((public.daily_tip dt
     CROSS JOIN public."user" u)
     LEFT JOIN ( SELECT dto.user_id,
            dto.daily_tip_id,
            max(dto.creation_date) AS latest_creation_date
           FROM public.daily_tip_occurrence dto
          GROUP BY dto.daily_tip_id, dto.user_id) latest_occurance ON (((latest_occurance.user_id = u.id) AND (latest_occurance.daily_tip_id = dt.id))))
     LEFT JOIN public.storage_file sf ON ((sf.id = dt.video_file_id)))
     LEFT JOIN user_trait_choices utc ON (((utc.user_id = u.id) AND (utc.trait_category_id = dt.personality_trait_category_id))))
  WHERE (dt.is_max = utc.is_max)
  ORDER BY u.id, latest_occurance.latest_creation_date NULLS FIRST, dt.id;


