    ed.order_index,
    sum((asv.is_completed)::integer) AS completed_session_count,
    (sum((asv.is_completed)::integer) > 0) AS has_completed_session,
    sum((asv.is_successful)::integer) AS successful_session_count,
    (sum((asv.is_successful)::integer) > 0) AS has_successful_session,
    (sum((asv.is_successful)::integer) = 1) AS single_successful_session
   FROM ((((public.exam_version ev
     LEFT JOIN public.exam_data ed ON ((ed.id = ev.exam_data_id)))
     CROSS JOIN public."user" u)
     LEFT JOIN public.answer_session_evaluation_view asv ON (((asv.exam_version_id = ev.id) AND (asv.user_id = u.id))))
     LEFT JOIN public.module_version mv ON ((mv.id = ev.module_version_id)))
  GROUP BY ev.id, u.id, mv.course_version_id, ed.order_index, ed.is_final
  ORDER BY u.id, ev.id;


