-- Name: exam_player_data_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.exam_player_data_view AS
 WITH latest_exam_version_cte AS (
         SELECT ev_1.exam_id,
            max(ev_1.id) AS version_id
           FROM public.exam_version ev_1
          GROUP BY ev_1.exam_id
        ), successful_answer_sessions AS (
         SELECT asev.answer_session_id,
            asev.user_id,
            asev.exam_version_id,
            asev.video_version_id,
            asev.start_date,
            asev.answer_session_acquired_points,
            asev.answer_session_success_rate,
            asev.is_successful,
            asev.answered_question_count,
            asev.correct_given_answer_count,
            asev.given_answer_count,
            asev.is_completed,
            asev.end_date,
            asev.answer_session_type
           FROM public.answer_session_view asev
          WHERE asev.is_successful
        ), latest_answer_session_data AS (
         SELECT lasv.user_id,
            lasv.exam_version_id,
            lasv.answer_session_id,
            asv.correct_given_answer_count AS correct_answer_count,
            asv.answered_question_count AS total_question_count,
            asv.answer_session_success_rate AS correct_answer_rate,
            asv.is_successful
           FROM (public.latest_answer_session_view lasv
             LEFT JOIN public.answer_session_view asv ON ((asv.answer_session_id = lasv.answer_session_id)))
        )
 SELECT u.id AS user_id,
    ex.id AS exam_id,
    ev.id AS exam_version_id,
    false AS is_deleted,
    ex.is_pretest,
    ex.is_signup,
    ed.title,
    ed.subtitle,
    ed.description,
    ed.thumbnail_url,
    ed.order_index,
    ed.is_final AS is_final_exam,
    lcvv.course_id,
    mv.module_id,
    ed.retake_limit,
    ( SELECT (count(1))::integer AS count
           FROM successful_answer_sessions sas
          WHERE ((sas.exam_version_id = ev.id) AND (sas.user_id = u.id))) AS successful_completion_count,
    ( SELECT ((count(1) <= ed.retake_limit) OR (ed.retake_limit IS NULL))
           FROM successful_answer_sessions sas
          WHERE ((sas.exam_version_id = ev.id) AND (sas.user_id = u.id))) AS can_retake,
    lasd.answer_session_id,
    lasd.correct_answer_count,
    lasd.total_question_count,
    lasd.correct_answer_rate,
    (lasd.total_question_count IS NOT NULL) AS is_completed_previously
   FROM (((((((public.exam ex
     LEFT JOIN latest_exam_version_cte levc ON ((levc.exam_id = ex.id)))
     LEFT JOIN public.exam_version ev ON ((ev.id = levc.version_id)))
     LEFT JOIN public.exam_data ed ON ((ed.id = ev.exam_data_id)))
     LEFT JOIN public.module_version mv ON ((mv.id = ev.module_version_id)))
     LEFT JOIN public.latest_course_version_view lcvv ON ((lcvv.version_id = mv.course_version_id)))
     CROSS JOIN public."user" u)
     LEFT JOIN latest_answer_session_data lasd ON (((lasd.user_id = u.id) AND (lasd.exam_version_id = levc.version_id))))
  ORDER BY u.id, ex.id;


ALTER TABLE public.exam_player_data_view OWNER TO dev_service_user;

--
-- Name: exam_result_stats_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.exam_result_stats_view AS
 WITH question_correct_answer_rates AS (
         SELECT ase_1.id AS answer_session_id,
            ase_1.user_id,
            qv.id AS question_version_id,
            ((avg((((ga.state)::text = 'CORRECT'::text))::integer))::integer * 100) AS correct_answer_rate
           FROM ((public.given_answer ga
             LEFT JOIN public.question_version qv ON ((qv.id = ga.question_version_id)))
             LEFT JOIN public.answer_session ase_1 ON ((ase_1.id = ga.answer_session_id)))
          GROUP BY ase_1.id, ase_1.user_id, qv.id
        ), fully_correctly_answered_questions AS (
         SELECT qcar.answer_session_id,
            (count(((qcar.correct_answer_rate = 100) OR NULL::boolean)))::integer AS fully_correctly_answered_questions_count
           FROM question_correct_answer_rates qcar
          GROUP BY qcar.answer_session_id
        ), answer_session_lengths AS (
         SELECT asv.answer_session_id,
            asv.start_date,
            asv.end_date,
            (EXTRACT(epoch FROM ((asv.end_date)::time without time zone - (asv.start_date)::time without time zone)))::double precision AS length_seconds
           FROM public.answer_session_view asv
          WHERE ((asv.start_date IS NOT NULL) AND (asv.end_date IS NOT NULL))
        ), avg_exam_score_per_company_cte AS (
         SELECT u_1.company_id,
            ev_1.exam_id,
            (avg(esv_1.score_percentage))::integer AS avg_score_percentage
           FROM (((public.exam_score_view esv_1
             LEFT JOIN public.exam_version ev_1 ON ((ev_1.id = esv_1.exam_version_id)))
             LEFT JOIN public.answer_session ase_1 ON ((ase_1.id = esv_1.answer_session_id)))
             LEFT JOIN public."user" u_1 ON ((u_1.id = ase_1.user_id)))
          GROUP BY u_1.company_id, ev_1.exam_id
        ), question_count AS (
         SELECT ev_1.id AS exam_version_id,
            (count(qv.id))::integer AS question_count
           FROM (public.exam_version ev_1
             LEFT JOIN public.question_version qv ON ((qv.exam_version_id = ev_1.id)))
          GROUP BY ev_1.id
        )
 SELECT u.id AS user_id,
    ev.id AS exam_version_id,
    ase.id AS answer_session_id,
    fcaq.fully_correctly_answered_questions_count,
    qc.question_count,
    (asl.length_seconds)::integer AS exam_length_seconds,
    esv.score_percentage,
    esv.exam_score,
    esv.exam_max_score,
    esv.answered_question_count,
    aespcc.avg_score_percentage,
    (esv.score_percentage - aespcc.avg_score_percentage) AS score_percentage_diff_from_avg,
    (NOT (ehsasv.is_highest_score IS DISTINCT FROM true)) AS is_highest_score_session
   FROM (((((((((public.answer_session ase
     LEFT JOIN public."user" u ON ((u.id = ase.user_id)))
     LEFT JOIN public.exam_highest_score_answer_session_view ehsasv ON ((ehsasv.answer_session_id = ase.id)))
     LEFT JOIN public.exam_version ev ON ((ev.id = ase.exam_version_id)))
     LEFT JOIN public.exam e ON ((e.id = ev.exam_id)))
     LEFT JOIN answer_session_lengths asl ON ((asl.answer_session_id = ase.id)))
     LEFT JOIN avg_exam_score_per_company_cte aespcc ON (((aespcc.company_id = u.company_id) AND (aespcc.exam_id = e.id))))
     LEFT JOIN fully_correctly_answered_questions fcaq ON ((fcaq.answer_session_id = ase.id)))
     LEFT JOIN question_count qc ON ((qc.exam_version_id = ase.id)))
     LEFT JOIN public.exam_score_view esv ON ((esv.answer_session_id = ase.id)))
  WHERE (e.id <> 1)
  ORDER BY u.id, e.id, ase.id;


ALTER TABLE public.exam_result_stats_view OWNER TO dev_service_user;

--
-- Name: exam_result_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.exam_result_view AS
 SELECT u.id AS user_id,
    ev.id AS exam_version_id,
    qv.id AS question_version_id,
    av.id AS answer_version_id,
    ase.id AS answer_session_id,
    ga.id AS given_answer_id,
    (NOT ((ga.state)::text IS DISTINCT FROM 'CORRECT'::text)) AS is_correct,
        CASE
            WHEN (ga.state IS NULL) THEN 'INCORRECT'::character varying
            ELSE ga.state
        END AS given_answer_state,
    COALESCE(ga.score, 0) AS question_score,
    ed.is_final AS is_final_exam,
    qd.question_text,
    qd.max_score AS question_max_score,
    asv.is_completed AS is_completed_session,
    asv.is_successful AS is_successful_session,
    (ecv.single_successful_session AND asv.is_successful) AS only_successful_session,
    agab.id AS answer_bridge_id,
    agab.answer_version_id AS user_answer_version_id,
    (NOT ((agab.answer_version_id = av.id) IS DISTINCT FROM true)) AS is_given_answer,
    (NOT (ad.is_correct IS DISTINCT FROM true)) AS is_answer_correct,
    ad.text AS answer_text,
    av.answer_id
   FROM ((((((((((((((public.exam_version ev
     CROSS JOIN public."user" u)
     JOIN public.latest_answer_session_view lasv ON (((lasv.user_id = u.id) AND (lasv.exam_version_id = ev.id))))
     LEFT JOIN public.answer_session ase ON ((ase.id = lasv.answer_session_id)))
     JOIN public.exam e ON (((e.id = ev.exam_id) AND (e.id <> 1))))
     LEFT JOIN public.question_version qv ON ((qv.exam_version_id = ev.id)))
     LEFT JOIN public.answer_version av ON ((av.question_version_id = qv.id)))
     LEFT JOIN public.given_answer ga ON (((ga.question_version_id = qv.id) AND (ga.answer_session_id = ase.id))))
     LEFT JOIN public.question_data qd ON ((qd.id = qv.question_data_id)))
     LEFT JOIN public.exam_data ed ON ((ed.id = ev.exam_data_id)))
     LEFT JOIN public.answer_session_view asv ON (((asv.exam_version_id = ev.id) AND (asv.answer_session_id = ase.id))))
     LEFT JOIN public.exam_completed_view ecv ON (((ecv.exam_version_id = ev.id) AND (ecv.user_id = u.id))))
     LEFT JOIN public.answer_data ad ON ((ad.id = av.answer_data_id)))
     LEFT JOIN public.answer_given_answer_bridge agab ON (((agab.given_answer_id = ga.id) AND (agab.answer_version_id = av.id))))
     CROSS JOIN public.constant_values_view consts)
  ORDER BY u.id, ev.id, ga.id DESC NULLS LAST, qv.id, av.id, ase.id;


ALTER TABLE public.exam_result_view OWNER TO dev_service_user;

