--
-- Name: home_page_stats_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.home_page_stats_view AS
 SELECT u.id AS user_id,
    ( SELECT COALESCE(sum((uprv.is_recommended_for_practise)::integer), (0)::bigint) AS "coalesce"
           FROM public.user_practise_recommendation_view uprv
          WHERE (uprv.user_id = u.id)) AS videos_to_be_repeated_count,
    ( SELECT (count(*))::integer AS count
           FROM public.course_item_completion_view cicv
          WHERE ((cicv.user_id = u.id) AND (cicv.completion_date > (CURRENT_DATE - 30)) AND (cicv.video_version_id IS NOT NULL) AND (cicv.is_pretest IS NOT TRUE))) AS completed_videos_last_month,
    ( SELECT round(avg((upv.performance_percentage)::integer), 0) AS round
           FROM ((((((public.activity_session ase
             LEFT JOIN public.user_session_activity usa ON ((usa.activity_session_id = ase.id)))
             LEFT JOIN public.video_version vv ON ((vv.id = usa.video_version_id)))
             LEFT JOIN public.exam_version ev ON ((ev.id = usa.exam_version_id)))
             LEFT JOIN public.module_version mv ON (((mv.id = vv.module_version_id) OR (mv.id = ev.module_version_id))))
             LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
             LEFT JOIN public.user_performance_view upv ON (((upv.course_id = cv.course_id) AND (upv.user_id = ase.user_id))))
          WHERE ((ase.start_date > (CURRENT_DATE - 30)) AND (upv.course_id IS NOT NULL))) AS performance_last_month
   FROM public."user" u
  GROUP BY u.id;


ALTER TABLE public.home_page_stats_view OWNER TO dev_service_user;

--
-- Name: most_productive_time_range_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.most_productive_time_range_view AS
 WITH generated_session_blocks(generated_session_block, block_end_time) AS (
         VALUES ('0:00-3:00'::text,'03:00:00'::time without time zone), ('3:00-6:00'::text,'06:00:00'::time without time zone), ('6:00-9:00'::text,'09:00:00'::time without time zone), ('9:00-12:00'::text,'12:00:00'::time without time zone), ('12:00-15:00'::text,'15:00:00'::time without time zone), ('15:00-18:00'::text,'18:00:00'::time without time zone), ('18:00-21:00'::text,'21:00:00'::time without time zone), ('21:00-0:00'::text,'24:00:00'::time without time zone)
        ), user_performance_with_session_blocks AS (
         SELECT carsv.user_id,
                CASE
                    WHEN ((carsv.start_date)::time without time zone <= '03:00:00'::time without time zone) THEN '0:00-3:00'::text
                    WHEN ((carsv.start_date)::time without time zone <= '06:00:00'::time without time zone) THEN '3:00-6:00'::text
                    WHEN ((carsv.start_date)::time without time zone <= '09:00:00'::time without time zone) THEN '6:00-9:00'::text
                    WHEN ((carsv.start_date)::time without time zone <= '12:00:00'::time without time zone) THEN '9:00-12:00'::text
                    WHEN ((carsv.start_date)::time without time zone <= '15:00:00'::time without time zone) THEN '12:00-15:00'::text
                    WHEN ((carsv.start_date)::time without time zone <= '18:00:00'::time without time zone) THEN '15:00-18:00'::text
                    WHEN ((carsv.start_date)::time without time zone <= '21:00:00'::time without time zone) THEN '18:00-21:00'::text
                    WHEN ((carsv.start_date)::time without time zone <= '24:00:00'::time without time zone) THEN '21:00-0:00'::text
                    ELSE NULL::text
                END AS session_block,
            avg(carsv.exam_correct_answer_rate) AS exam_correct_answer_rate,
            avg(carsv.practise_correct_answer_rate) AS practise_correct_answer_rate,
            avg(carsv.video_correct_answer_rate) AS video_correct_answer_rate
           FROM public.correct_answer_rates_split_view carsv
          GROUP BY carsv.user_id, carsv.start_date
        )
 SELECT u.id AS user_id,
    gsb.generated_session_block AS session_block,
    ((((COALESCE((upwsb.exam_correct_answer_rate * 2.5), (0)::numeric) + COALESCE((upwsb.video_correct_answer_rate * 1.5), (0)::numeric)) + COALESCE(upwsb.practise_correct_answer_rate, (0)::numeric)))::integer / 5) AS performance_percentage
   FROM ((generated_session_blocks gsb
     CROSS JOIN public."user" u)
     LEFT JOIN user_performance_with_session_blocks upwsb ON (((upwsb.user_id = u.id) AND (upwsb.session_block = gsb.generated_session_block))))
  ORDER BY u.id, gsb.block_end_time;


ALTER TABLE public.most_productive_time_range_view OWNER TO dev_service_user;

