--
-- Name: user_daily_activity_chart_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_daily_activity_chart_view AS
 WITH generated_days_of_the_week AS (
         SELECT generate_series(0, 6) AS day_of_the_week
        ), generated_days_with_users AS (
         SELECT u.id AS user_id,
            gdotw.day_of_the_week
           FROM (generated_days_of_the_week gdotw
             CROSS JOIN public."user" u)
        ), user_session_activity_groups AS (
         SELECT usv.user_id,
            EXTRACT(isodow FROM usv.start_date) AS day_of_the_week,
            sum(usv.length_seconds) AS total_session_length_seconds
           FROM public.user_session_view usv
          GROUP BY usv.user_id, (EXTRACT(isodow FROM usv.start_date))
        )
 SELECT gdwu.user_id,
    usag.total_session_length_seconds,
    gdwu.day_of_the_week
   FROM (generated_days_with_users gdwu
     LEFT JOIN user_session_activity_groups usag ON (((usag.day_of_the_week = (gdwu.day_of_the_week)::numeric) AND (usag.user_id = gdwu.user_id))))
  ORDER BY gdwu.day_of_the_week;


ALTER TABLE public.user_daily_activity_chart_view OWNER TO dev_service_user;

--
-- Name: improve_yourself_page_stats_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.improve_yourself_page_stats_view AS
 SELECT u.id AS user_id,
    ( SELECT (array_agg(mptrv.session_block ORDER BY mptrv.performance_percentage DESC))[1] AS array_agg
           FROM public.most_productive_time_range_view mptrv
          WHERE (mptrv.user_id = u.id)) AS most_productive_time_range,
    ( SELECT udacv.day_of_the_week
           FROM public.user_daily_activity_chart_view udacv
          WHERE ((udacv.user_id = u.id) AND (udacv.total_session_length_seconds = ( SELECT max(udacv2.total_session_length_seconds) AS max
                   FROM public.user_daily_activity_chart_view udacv2
                  WHERE (udacv2.user_id = u.id))))) AS most_active_day
   FROM public."user" u;


