--
-- Name: practise_question_info_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.practise_question_info_view AS
 WITH latest_given_answer_cte AS (
         SELECT ase_1.user_id,
            ga.question_version_id,
            max(ga.id) AS latest_id,
            (count(*))::integer AS answer_count,
            (sum(
                CASE
                    WHEN ga.is_practise_answer THEN 1
                    ELSE 0
                END))::integer AS practise_answer_count
           FROM ((public.given_answer ga
             LEFT JOIN public.answer_session ase_1 ON ((ase_1.id = ga.answer_session_id)))
             JOIN public.question_version qv_1 ON (((qv_1.id = ga.question_version_id) AND (qv_1.video_version_id IS NOT NULL))))
          GROUP BY ga.question_version_id, ase_1.user_id
          ORDER BY ase_1.user_id
        )
 SELECT lgac.user_id,
    qv.question_id,
    lgac.question_version_id,
    lgac.answer_count,
    lgac.practise_answer_count,
    latest_ga.creation_date AS given_answer_date,
    latest_ga.id AS given_answer_id,
    ((latest_ga.state)::text = 'CORRECT'::text) AS is_correct,
    ase.is_practise
   FROM (((latest_given_answer_cte lgac
     LEFT JOIN public.given_answer latest_ga ON ((latest_ga.id = lgac.latest_id)))
     LEFT JOIN public.answer_session ase ON ((ase.id = latest_ga.answer_session_id)))
     JOIN public.question_version qv ON ((qv.id = latest_ga.question_version_id)));


ALTER TABLE public.practise_question_info_view OWNER TO dev_service_user;

--
-- Name: practise_question_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.practise_question_view AS
 WITH practise_question_ids AS (
         SELECT qv_1.question_id,
            ase.user_id,
            count(ga.id) AS given_answer_count,
            max(ga.id) AS latest_given_answer_id
           FROM ((public.question_version qv_1
             JOIN public.given_answer ga ON ((ga.question_version_id = qv_1.id)))
             LEFT JOIN public.answer_session ase ON ((ase.id = ga.answer_session_id)))
          WHERE (qv_1.video_version_id IS NOT NULL)
          GROUP BY qv_1.question_id, ase.user_id
        ), practise_question_counts AS (
         SELECT pqi.question_id,
            pqi.user_id,
            count(ga.id) AS practise_answer_count
           FROM (((practise_question_ids pqi
             LEFT JOIN public.question_version qv_1 ON ((qv_1.question_id = pqi.question_id)))
             LEFT JOIN public.given_answer ga ON ((ga.question_version_id = qv_1.id)))
             JOIN public.answer_session ase ON (((ase.id = ga.answer_session_id) AND ase.is_practise)))
          GROUP BY pqi.question_id, pqi.user_id
        ), practise_questions AS (
         SELECT pqi.question_id,
            pqi.user_id,
            pqi.given_answer_count,
            pqi.latest_given_answer_id
           FROM ((practise_question_ids pqi
             LEFT JOIN practise_question_counts pqc ON (((pqc.question_id = pqi.question_id) AND (pqc.user_id = pqi.user_id))))
             LEFT JOIN public.given_answer ga ON ((ga.id = pqi.latest_given_answer_id)))
          WHERE ((pqc.practise_answer_count < 2) AND (((ga.is_practise_answer = false) AND ((ga.state)::text <> 'CORRECT'::text) AND ((ga.creation_date + '00:05:00'::interval) < now())) OR ((ga.is_practise_answer = false) AND ((ga.state)::text = 'CORRECT'::text) AND ((ga.creation_date + '00:20:00'::interval) < now())) OR ((ga.is_practise_answer = true) AND ((ga.state)::text <> 'CORRECT'::text) AND ((ga.creation_date + '01:00:00'::interval) < now()))))
        ), latest_question_version AS (
         SELECT max(qv_1.id) AS version_id,
            qv_1.question_id
           FROM public.question_version qv_1
          GROUP BY qv_1.question_id
        )
 SELECT qv.id AS question_version_id,
    qd.question_text,
    qd.type_id AS question_type_id,
    av.id AS answer_id,
    ad.text AS answer_text,
    pq.user_id,
    pq.latest_given_answer_id,
    pq.given_answer_count
   FROM (((((practise_questions pq
     LEFT JOIN latest_question_version lqv ON ((lqv.question_id = pq.question_id)))
     LEFT JOIN public.question_version qv ON ((qv.id = lqv.version_id)))
     LEFT JOIN public.question_data qd ON ((qd.id = qv.question_data_id)))
     LEFT JOIN public.answer_version av ON ((av.question_version_id = qv.id)))
     LEFT JOIN public.answer_data ad ON ((ad.id = av.answer_data_id)));


ALTER TABLE public.practise_question_view OWNER TO dev_service_user;

