CREATE VIEW public.role_list_view AS
 WITH roles AS (
         SELECT upv.assignee_user_id,
            r_1.id AS role_id
           FROM (public.role r_1
             JOIN public.user_permission_view upv ON ((((upv.context_company_id = r_1.company_id) AND (upv.permission_code = 'VIEW_CUSTOM_ROLES'::text)) OR ((r_1.company_id IS NULL) AND (upv.permission_code = 'VIEW_PREDEFINED_ROLES'::text)))))
        )
 SELECT u.id AS user_id,
    u.email AS user_email,
    co.id AS owner_company_id,
    (r.deletion_date IS NOT NULL) AS is_deleted,
    r.id AS role_id,
    r.name AS role_name,
    co.name AS owner_name,
    pe.id AS permission_id,
    pe.code AS permission_code
   FROM (((((roles
     LEFT JOIN public."user" u ON ((u.id = roles.assignee_user_id)))
     LEFT JOIN public.role r ON ((r.id = roles.role_id)))
     LEFT JOIN public.company co ON ((co.id = r.company_id)))
     LEFT JOIN public.role_permission_bridge rpb ON ((rpb.role_id = r.id)))
     LEFT JOIN public.permission pe ON ((pe.id = rpb.permission_id)))
  ORDER BY u.id, co.id, r.id, pe.id;


