--
-- Name: signup_question_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.signup_question_view AS
 WITH latest_signup_exam_version AS (
         SELECT max(ev_1.id) AS version_id
           FROM (public.exam_version ev_1
             JOIN public.exam e ON (((e.id = ev_1.exam_id) AND e.is_signup)))
        ), latest_given_answer_ids AS (
         SELECT max(ga_1.id) AS given_answer_id,
            ase_1.id AS answer_session_id,
            ga_1.question_version_id
           FROM (public.given_answer ga_1
             LEFT JOIN public.answer_session ase_1 ON ((ase_1.id = ga_1.answer_session_id)))
          GROUP BY ase_1.id, ga_1.question_version_id
        )
 SELECT u.id AS user_id,
    qv.question_id,
    qv.id AS question_version_id,
    qd.question_text,
    qd.image_url,
    qd.type_id,
    av.answer_id,
    av.id AS answer_version_id,
    ad.text AS answer_text,
    lgai.given_answer_id,
    ((ga.state)::text = 'CORRECT'::text) AS is_correct,
    agab.answer_version_id AS given_answer_version_id,
    (agab.answer_version_id = av.id) AS is_given_answer
   FROM ((((((((((latest_signup_exam_version lsev
     CROSS JOIN public."user" u)
     LEFT JOIN public.exam_version ev ON ((ev.id = lsev.version_id)))
     LEFT JOIN public.question_version qv ON ((qv.exam_version_id = ev.id)))
     LEFT JOIN public.answer_version av ON ((av.question_version_id = qv.id)))
     LEFT JOIN public.answer_session ase ON (((ase.user_id = u.id) AND (ase.exam_version_id = ev.id))))
     LEFT JOIN latest_given_answer_ids lgai ON (((lgai.question_version_id = qv.id) AND (lgai.answer_session_id = ase.id))))
     LEFT JOIN public.given_answer ga ON ((ga.id = lgai.given_answer_id)))
     LEFT JOIN public.answer_given_answer_bridge agab ON ((agab.given_answer_id = lgai.given_answer_id)))
     LEFT JOIN public.answer_data ad ON ((ad.id = av.answer_data_id)))
     LEFT JOIN public.question_data qd ON ((qd.id = qv.question_data_id)))
  ORDER BY u.id, (md5((qv.id || '1'::text))), av.id;


ALTER TABLE public.signup_question_view OWNER TO dev_service_user;

