-- Name: user_daily_course_item_progress_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_daily_course_item_progress_view AS
 WITH completed_items AS (
         SELECT cicv_1.user_id,
            cicv_1.course_id,
            cicv_1.video_version_id,
            vd.title,
            date_trunc('day'::text, cicv_1.completion_date) AS completion_date
           FROM ((public.course_item_completion_view cicv_1
             LEFT JOIN public.video_version vv ON ((vv.id = cicv_1.video_version_id)))
             LEFT JOIN public.video_data vd ON ((vd.id = vv.video_data_id)))
          WHERE ((cicv_1.is_pretest IS NOT TRUE) AND (cicv_1.video_version_id IS NOT NULL))
        ), completed_item_groups AS (
         SELECT ci.user_id,
            ci.course_id,
            ci.completion_date,
            (count(ci.completion_date))::integer AS completed_item_count
           FROM completed_items ci
          GROUP BY ci.user_id, ci.course_id, ci.completion_date
        )
 SELECT cig.user_id,
    cig.course_id,
    cig.completion_date,
    cig.completed_item_count,
    (((cig.completed_item_count)::double precision / (cicv.item_count)::double precision) * (100)::double precision) AS completed_percentage,
    ((cig.completion_date)::date - (ucb.start_date)::date) AS offset_days_from_start,
    (cig.completion_date = date_trunc('day'::text, now())) AS is_current
   FROM ((completed_item_groups cig
     LEFT JOIN public.user_course_bridge ucb ON (((ucb.course_id = cig.course_id) AND (ucb.user_id = cig.user_id))))
     LEFT JOIN public.course_item_count_view cicv ON ((cicv.course_id = cig.course_id)))
  ORDER BY cig.completion_date;


ALTER TABLE public.user_daily_course_item_progress_view OWNER TO dev_service_user;

--
-- Name: user_daily_progress_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_daily_progress_view AS
 WITH practise_question_spent_time AS (
         SELECT u_1.id AS user_id,
            ga.course_id,
            ga.creation_date,
            ((count(ga.id) * 15))::integer AS spent_seconds
           FROM ((public."user" u_1
             LEFT JOIN public.answer_session_view asv ON (((asv.user_id = u_1.id) AND (asv.answer_session_type = 'practise'::text))))
             LEFT JOIN ( SELECT ga_1.id,
                    cv.course_id,
                    ga_1.answer_session_id,
                    date_trunc('day'::text, ga_1.creation_date) AS creation_date
                   FROM ((((public.given_answer ga_1
                     LEFT JOIN public.question_version qv ON ((qv.id = ga_1.question_version_id)))
                     LEFT JOIN public.video_version vv ON ((vv.id = qv.video_version_id)))
                     LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)))
                     LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))) ga ON ((ga.answer_session_id = asv.answer_session_id)))
          WHERE (ga.id IS NOT NULL)
          GROUP BY u_1.id, ga.course_id, ga.creation_date
          ORDER BY u_1.id, ga.course_id, ga.creation_date
        ), exam_spent_time AS (
         SELECT u_1.id AS user_id,
            asv.course_id,
            asv.creation_date,
            sum(asv.elapsed_seconds) AS spent_seconds
           FROM ((public."user" u_1
             LEFT JOIN ( SELECT asv_1.answer_session_id,
                    asv_1.user_id,
                    cv.course_id,
                    ev.exam_id,
                    date_trunc('day'::text, asv_1.end_date) AS creation_date,
                    EXTRACT(epoch FROM (asv_1.end_date - asv_1.start_date)) AS elapsed_seconds
                   FROM (((public.answer_session_view asv_1
                     LEFT JOIN public.exam_version ev ON ((ev.id = asv_1.exam_version_id)))
                     LEFT JOIN public.module_version mv ON ((mv.id = ev.module_version_id)))
                     LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
                  WHERE ((asv_1.start_date IS NOT NULL) AND (asv_1.end_date IS NOT NULL))) asv ON ((asv.user_id = u_1.id)))
             LEFT JOIN public.exam e ON ((e.id = asv.exam_id)))
          WHERE ((e.id <> 1) AND (e.id IS NOT NULL))
          GROUP BY u_1.id, asv.course_id, asv.creation_date
          ORDER BY u_1.id, asv.course_id, asv.creation_date
        ), video_watch_spent_time AS (
         SELECT u_1.id AS user_id,
            vps.course_id,
            vps.creation_date,
            COALESCE(sum(vps.elapsed_seconds), (0)::double precision) AS spent_seconds
           FROM ((public."user" u_1
             LEFT JOIN ( SELECT vps_1.id,
                    date_trunc('day'::text, vps_1.creation_date) AS creation_date,
                    vps_1.user_id,
                    vv.video_id,
                    cv.course_id,
                    (vps_1.to_seconds - vps_1.from_seconds) AS elapsed_seconds
                   FROM (((public.video_playback_sample vps_1
                     LEFT JOIN public.video_version vv ON ((vv.id = vps_1.video_version_id)))
                     LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)))
                     LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))) vps ON ((vps.user_id = u_1.id)))
             LEFT JOIN public.video v ON ((vps.video_id = v.id)))
          WHERE (v.id IS NOT NULL)
          GROUP BY u_1.id, vps.course_id, vps.creation_date
          ORDER BY u_1.id, vps.course_id, vps.creation_date
        ), video_question_spent_time AS (
         SELECT u_1.id AS user_id,
            cv.course_id,
            ga.creation_date,
            COALESCE(sum(ga.elapsed_seconds), (0)::double precision) AS spent_seconds
           FROM (((((public."user" u_1
             LEFT JOIN public.answer_session_view asv ON (((asv.video_version_id IS NOT NULL) AND (asv.user_id = u_1.id))))
             LEFT JOIN ( SELECT ga_1.id,
                    ga_1.answer_session_id,
                    ga_1.elapsed_seconds,
                    date_trunc('day'::text, ga_1.creation_date) AS creation_date
                   FROM public.given_answer ga_1) ga ON ((ga.answer_session_id = asv.answer_session_id)))
             LEFT JOIN public.video_version vv ON ((vv.id = asv.video_version_id)))
             LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)))
             LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
          WHERE (ga.creation_date IS NOT NULL)
          GROUP BY u_1.id, cv.course_id, ga.creation_date
          ORDER BY u_1.id, cv.course_id, ga.creation_date
        )
 SELECT u.id AS user_id,
    co.id AS course_id,
    asd.creation_date,
    sum(asd.spent_seconds) AS spent_seconds
   FROM ((public."user" u
     CROSS JOIN public.course co)
     LEFT JOIN ( SELECT pqst.user_id,
            NULL::integer AS course_id,
            pqst.creation_date,
            pqst.spent_seconds,
            'practise_question'::text AS tag
           FROM practise_question_spent_time pqst
        UNION
         SELECT est.user_id,
            est.course_id,
            est.creation_date,
            est.spent_seconds,
            'exam'::text AS tag
           FROM exam_spent_time est
        UNION
         SELECT vwst.user_id,
            vwst.course_id,
            vwst.creation_date,
            vwst.spent_seconds,
            'video_watch'::text AS tag
           FROM video_watch_spent_time vwst
        UNION
         SELECT vqst.user_id,
            vqst.course_id,
            vqst.creation_date,
            vqst.spent_seconds,
            'video_question'::text AS tag
           FROM video_question_spent_time vqst) asd ON (((asd.user_id = u.id) AND (asd.course_id = co.id))))
  GROUP BY u.id, co.id, asd.creation_date
  ORDER BY u.id, co.id;


ALTER TABLE public.user_daily_progress_view OWNER TO dev_service_user;

--
-- Name: user_inactive_course_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_inactive_course_view AS
 SELECT user_course_sessions.user_id,
    count(user_course_sessions.course_id) AS inactive_course_count
   FROM ( SELECT DISTINCT ON (cv.course_id) usv.user_id,
            usv.end_date AS session_end_date,
            cv.course_id,
            EXTRACT(week FROM usv.start_date) AS week,
            count((cv.course_id * '-10'::integer)) AS points
           FROM (((((((public.user_session_view usv
             LEFT JOIN public.user_session_activity usa ON ((usa.activity_session_id = usv.id)))
             LEFT JOIN public.video_version vv ON ((vv.id = usa.video_version_id)))
             LEFT JOIN public.exam_version ev ON ((ev.id = usa.exam_version_id)))
             LEFT JOIN public.module_version mv ON (((mv.id = vv.module_version_id) OR (mv.id = ev.module_version_id))))
             LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
             LEFT JOIN public.course_progress_view cpv ON (((cpv.user_id = usv.user_id) AND (cpv.course_id = cv.course_id))))
             LEFT JOIN public.user_course_bridge ucb ON (((ucb.user_id = usv.user_id) AND (ucb.course_id = cv.course_id))))
          WHERE ((usv.start_date > (CURRENT_DATE - 30)) AND (usv.end_date < (CURRENT_DATE - 14)) AND (ucb.creation_date > (CURRENT_DATE - 30)) AND (cpv.progress_percentage < 50) AND (usv.length_seconds <> 0) AND (usv.is_finalized = true))
          GROUP BY usv.user_id, usv.start_date, usv.end_date, cv.course_id
          ORDER BY cv.course_id, usv.end_date DESC) user_course_sessions
  GROUP BY user_course_sessions.user_id;


ALTER TABLE public.user_inactive_course_view OWNER TO dev_service_user;

--
-- Name: user_engagement_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_engagement_view AS
 WITH sessions AS (
         SELECT usv.user_id,
            EXTRACT(week FROM usv.start_date) AS week_num,
            (usv.length_seconds > (60 * 15)) AS is_longer_than_fifteen_minutes,
            ((usv.length_seconds < (60 * 5)) AND (usv.length_seconds <> 0)) AS is_shorter_than_five_minutes
           FROM public.user_session_view usv
          WHERE (usv.is_finalized = true)
        ), session_groups AS (
         SELECT s.user_id,
            s.week_num,
            count(1) AS total_session_count,
            sum((s.is_longer_than_fifteen_minutes)::integer) AS is_longer_than_fifteen_minutes_count,
            sum((s.is_shorter_than_five_minutes)::integer) AS is_shorter_than_five_minutes_count
           FROM sessions s
          GROUP BY s.week_num, s.user_id
        ), session_points AS (
         SELECT sg.user_id,
            sum(LEAST((sg.total_session_count * 1), (10)::bigint)) AS session_count_points,
            sum(LEAST((sg.is_longer_than_fifteen_minutes_count * 5), (40)::bigint)) AS is_longer_than_fifteen_minutes_points,
            sum(GREATEST((sg.is_shorter_than_five_minutes_count * '-3'::integer), ('-15'::integer)::bigint)) AS is_shorter_than_five_minutes_points
           FROM session_groups sg
          GROUP BY sg.user_id
        ), total_session_length_points AS (
         SELECT sq.user_id,
                CASE
                    WHEN (sq.length_minutes > 360) THEN 50
                    WHEN (sq.length_minutes > 240) THEN 45
                    WHEN (sq.length_minutes > 180) THEN 40
                    WHEN (sq.length_minutes > 120) THEN 30
                    WHEN (sq.length_minutes > 60) THEN 15
                    WHEN (sq.length_minutes > 0) THEN 10
                    ELSE 0
                END AS total_session_length_points
           FROM ( SELECT usv.user_id,
                    (sum(usv.length_seconds) / 60) AS length_minutes
                   FROM public.user_session_view usv
                  WHERE (usv.start_date > (CURRENT_DATE - 30))
                  GROUP BY usv.user_id) sq
        )
 SELECT u.id AS user_id,
    ((((((tslp.total_session_length_points)::numeric + sp.session_count_points) + sp.is_longer_than_fifteen_minutes_points) + sp.is_shorter_than_five_minutes_points) + ((COALESCE(uicv.inactive_course_count, (0)::bigint) * (- 10)))::numeric))::integer AS engagement_points
   FROM (((public."user" u
     LEFT JOIN session_points sp ON ((sp.user_id = u.id)))
     LEFT JOIN total_session_length_points tslp ON ((tslp.user_id = u.id)))
     LEFT JOIN public.user_inactive_course_view uicv ON ((uicv.user_id = u.id)));


ALTER TABLE public.user_engagement_view OWNER TO dev_service_user;

