-- Name: user_exam_stats_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_exam_stats_view AS
 SELECT DISTINCT ON (e.id) e.id AS exam_id,
    ed.title AS exam_title,
    u.id AS user_id,
    cv.course_id,
    asv.answer_session_success_rate AS correct_answer_rate,
        CASE
            WHEN asv.is_successful THEN false
            ELSE true
        END AS should_practise_exam,
    round(((asv.answer_session_acquired_points / 4))::double precision) AS correct_answer_count,
    (EXTRACT(epoch FROM ((asv.end_date - asv.start_date))::time without time zone))::integer AS exam_length_seconds,
    asv.end_date AS last_completion_date,
    ( SELECT avg(ga_1.elapsed_seconds) AS average_reaction_time
           FROM public.given_answer ga_1
          WHERE (ga_1.answer_session_id = asv.answer_session_id)) AS average_reaction_time
   FROM (((((((public.exam e
     LEFT JOIN public.exam_version ev ON ((ev.exam_id = e.id)))
     LEFT JOIN public.exam_data ed ON ((ed.id = ev.exam_data_id)))
     LEFT JOIN public.answer_session_view asv ON ((asv.exam_version_id = ev.id)))
     LEFT JOIN public.given_answer ga ON ((ga.answer_session_id = asv.answer_session_id)))
     LEFT JOIN public."user" u ON ((u.id = asv.user_id)))
     LEFT JOIN public.module_version mv ON ((mv.id = ev.module_version_id)))
     LEFT JOIN public.course_version cv ON ((cv.id = mv.course_version_id)))
  WHERE ((u.id IS NOT NULL) AND (e.is_pretest IS FALSE) AND (e.is_signup IS FALSE))
  ORDER BY e.id, asv.end_date DESC;


