--
-- Name: user_reaction_time_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_reaction_time_view AS
 WITH user_exam AS (
         SELECT u_1.id AS user_id,
            ev.exam_id,
            asv.answer_session_id,
            EXTRACT(seconds FROM (asv.end_date - asv.start_date)) AS exam_length_seconds,
            asv.answer_session_success_rate AS exam_correct_answer_rate
           FROM ((public."user" u_1
             LEFT JOIN public.answer_session_view asv ON ((asv.user_id = u_1.id)))
             LEFT JOIN public.exam_version ev ON ((ev.id = asv.exam_version_id)))
          WHERE ((asv.answer_session_type = 'exam'::text) AND (asv.end_date IS NOT NULL))
        ), user_exam_averages AS (
         SELECT sq.user_id,
            ((100.0 * (sq.average_exam_length_seconds - sq.total_average_exam_length_seconds)) / sq.total_average_exam_length_seconds) AS exam_length_percent_diff
           FROM ( SELECT u_1.id AS user_id,
                    ( SELECT avg(ue.exam_length_seconds) AS avg
                           FROM user_exam ue) AS total_average_exam_length_seconds,
                    ( SELECT avg(ue.exam_length_seconds) AS average_exam_length_seconds
                           FROM user_exam ue
                          WHERE ((ue.user_id = u_1.id) AND ((ue.exam_correct_answer_rate)::numeric > 0.70))) AS average_exam_length_seconds
                   FROM public."user" u_1
                  GROUP BY u_1.id) sq
        ), user_exam_points AS (
         SELECT uea.user_id,
            uea.exam_length_percent_diff,
                CASE
                    WHEN (uea.exam_length_percent_diff > (65)::numeric) THEN 0
                    WHEN (uea.exam_length_percent_diff > (55)::numeric) THEN 10
                    WHEN (uea.exam_length_percent_diff > (45)::numeric) THEN 20
                    WHEN (uea.exam_length_percent_diff > (30)::numeric) THEN 25
                    WHEN (uea.exam_length_percent_diff > (15)::numeric) THEN 30
                    WHEN (uea.exam_length_percent_diff > ('-15'::integer)::numeric) THEN 50
                    WHEN (uea.exam_length_percent_diff > ('-25'::integer)::numeric) THEN 65
                    WHEN (uea.exam_length_percent_diff > ('-35'::integer)::numeric) THEN 80
                    WHEN (uea.exam_length_percent_diff > ('-50'::integer)::numeric) THEN 90
                    WHEN (uea.exam_length_percent_diff < ('-50'::integer)::numeric) THEN 100
                    ELSE NULL::integer
                END AS user_exam_length_points
           FROM user_exam_averages uea
        ), user_answers AS (
         SELECT ga.id AS given_answer_id,
            ((ga.state)::text = 'CORRECT'::text) AS given_answer_is_correct,
            ga.elapsed_seconds,
            ga.answer_session_id,
            asv.user_id,
            asv.start_date,
            asv.end_date,
            asv.answer_session_type
           FROM (public.given_answer ga
             LEFT JOIN public.answer_session_view asv ON ((asv.answer_session_id = ga.answer_session_id)))
        ), user_reaction_averages AS (
         SELECT sq.user_id,
            sq.average_reaction_time,
            sq.total_average_reaction_time,
            (((100.0)::double precision * (sq.average_reaction_time - sq.total_average_reaction_time)) / sq.total_average_reaction_time) AS reaction_time_percent_diff
           FROM ( SELECT u_1.id AS user_id,
                    ( SELECT avg(ua.elapsed_seconds) AS avg
                           FROM user_answers ua
                          WHERE ((ua.elapsed_seconds IS NOT NULL) AND (ua.user_id = u_1.id))) AS average_reaction_time,
                    ( SELECT avg(ua.elapsed_seconds) AS avg
                           FROM user_answers ua
                          WHERE (ua.elapsed_seconds IS NOT NULL)) AS total_average_reaction_time
                   FROM public."user" u_1) sq
        ), user_reaction_points AS (
         SELECT ura.user_id,
            ura.reaction_time_percent_diff,
                CASE
                    WHEN (ura.reaction_time_percent_diff > (65)::double precision) THEN 0
                    WHEN (ura.reaction_time_percent_diff > (55)::double precision) THEN 10
                    WHEN (ura.reaction_time_percent_diff > (45)::double precision) THEN 20
                    WHEN (ura.reaction_time_percent_diff > (30)::double precision) THEN 25
                    WHEN (ura.reaction_time_percent_diff > (15)::double precision) THEN 30
                    WHEN (ura.reaction_time_percent_diff > ('-15'::integer)::double precision) THEN 50
                    WHEN (ura.reaction_time_percent_diff > ('-25'::integer)::double precision) THEN 65
                    WHEN (ura.reaction_time_percent_diff > ('-35'::integer)::double precision) THEN 80
                    WHEN (ura.reaction_time_percent_diff > ('-50'::integer)::double precision) THEN 90
                    WHEN (ura.reaction_time_percent_diff < ('-50'::integer)::double precision) THEN 100
                    ELSE NULL::integer
                END AS user_reaction_time_points
           FROM user_reaction_averages ura
        )
 SELECT u.id AS user_id,
    COALESCE(uep.user_exam_length_points, 0) AS user_exam_length_points,
    COALESCE(urp.user_reaction_time_points, 0) AS user_reaction_time_points,
    (((COALESCE((urp.user_reaction_time_points)::double precision, (0)::double precision) * (3)::double precision) + COALESCE((uep.user_exam_length_points)::double precision, (0)::double precision)) / (4)::double precision) AS total_user_reaction_time_points,
    urp.reaction_time_percent_diff
   FROM (((public."user" u
     LEFT JOIN public.user_performance_answer_group_view upagv ON ((upagv.user_id = u.id)))
     LEFT JOIN user_exam_points uep ON ((uep.user_id = u.id)))
     LEFT JOIN user_reaction_points urp ON ((urp.user_id = u.id)))
  GROUP BY u.id, uep.user_exam_length_points, urp.user_reaction_time_points, urp.reaction_time_percent_diff;


ALTER TABLE public.user_reaction_time_view OWNER TO dev_service_user;

--
-- Name: user_session_block_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_session_block_view AS
 WITH session_average AS (
         SELECT usv.user_id,
            ((avg(((usv.start_date)::time without time zone)::interval) + avg(((usv.end_date)::time without time zone)::interval)) / (2)::double precision) AS average_time_center
           FROM public.user_session_view usv
          GROUP BY usv.user_id
        )
 SELECT u.id AS user_id,
        CASE
            WHEN ((sa.average_time_center >= ('00:00:00'::time without time zone)::interval) AND (sa.average_time_center <= ('03:00:00'::time without time zone)::interval)) THEN '0:00-3:00'::text
            WHEN ((sa.average_time_center > ('03:00:00'::time without time zone)::interval) AND (sa.average_time_center <= ('06:00:00'::time without time zone)::interval)) THEN '3:00-6:00'::text
            WHEN ((sa.average_time_center > ('06:00:00'::time without time zone)::interval) AND (sa.average_time_center <= ('09:00:00'::time without time zone)::interval)) THEN '6:00-9:00'::text
            WHEN ((sa.average_time_center > ('09:00:00'::time without time zone)::interval) AND (sa.average_time_center <= ('12:00:00'::time without time zone)::interval)) THEN '9:00-12:00'::text
            WHEN ((sa.average_time_center > ('12:00:00'::time without time zone)::interval) AND (sa.average_time_center <= ('15:00:00'::time without time zone)::interval)) THEN '12:00-15:00'::text
            WHEN ((sa.average_time_center > ('15:00:00'::time without time zone)::interval) AND (sa.average_time_center <= ('18:00:00'::time without time zone)::interval)) THEN '15:00-18:00'::text
            WHEN ((sa.average_time_center > ('18:00:00'::time without time zone)::interval) AND (sa.average_time_center <= ('21:00:00'::time without time zone)::interval)) THEN '18:00-21:00'::text
            WHEN ((sa.average_time_center > ('21:00:00'::time without time zone)::interval) AND (sa.average_time_center <= ('24:00:00'::time without time zone)::interval)) THEN '21:00-0:00'::text
            ELSE NULL::text
        END AS average_session_block
   FROM (public."user" u
     LEFT JOIN session_average sa ON ((sa.user_id = u.id)));


ALTER TABLE public.user_session_block_view OWNER TO dev_service_user;

--
-- Name: user_learning_overview_stats_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_learning_overview_stats_view AS
 WITH stats AS (
         SELECT u.id AS user_id,
            u.email AS user_email,
            ( SELECT avg(upv_1.performance_percentage) AS avg
                   FROM public.user_performance_view upv_1
                  WHERE ((upv_1.user_id = u.id) AND (upv_1.performance_percentage <> (0)::double precision) AND (upv_1.performance_percentage IS NOT NULL))) AS performance_percentage,
            urtv.reaction_time_percent_diff AS user_reaction_time_difference_percentage,
            urtv.user_reaction_time_points,
            urtv.user_exam_length_points,
            urtv.total_user_reaction_time_points,
            usbv.average_session_block AS most_frequent_time_range,
            ( SELECT uev.engagement_points
                   FROM public.user_engagement_view uev
                  WHERE (uev.user_id = u.id)) AS engagement_points,
            ( SELECT (sum(usav.length_seconds))::integer AS sum
                   FROM public.user_session_view usav
                  WHERE (usav.user_id = u.id)) AS total_time_active_on_platform_seconds,
            ( SELECT (count(*))::integer AS count
                   FROM public.course_item_completion_view cicv
                  WHERE ((cicv.user_id = u.id) AND (cicv.video_version_id IS NOT NULL))) AS watched_videos,
            ( SELECT (sum((ecv.has_completed_session)::integer))::integer AS sum
                   FROM public.exam_completed_view ecv
                  WHERE (ecv.user_id = u.id)) AS completed_exam_count,
            ( SELECT (count(ga.id))::integer AS count
                   FROM (public.given_answer ga
                     LEFT JOIN public.answer_session_view asv ON (((asv.answer_session_id = ga.answer_session_id) AND ((asv.answer_session_type = 'video'::text) OR (asv.answer_session_type = 'practise'::text)))))
                  WHERE (asv.user_id = u.id)) AS answered_video_and_practise_quiz_questions,
            ( SELECT (count(ga.id))::integer AS count
                   FROM (public.given_answer ga
                     LEFT JOIN public.answer_session_view asv ON (((asv.answer_session_id = ga.answer_session_id) AND ((asv.answer_session_type = 'video'::text) OR (asv.answer_session_type = 'practise'::text)))))
                  WHERE ((asv.user_id = u.id) AND ((ga.state)::text = 'CORRECT'::text))) AS correct_answered_video_and_practise_quiz_questions,
            ( SELECT ((count(*))::double precision / (30)::double precision)
                   FROM public.course_item_completion_view cicv
                  WHERE ((cicv.user_id = u.id) AND (cicv.completion_date > (CURRENT_DATE - 30)))) AS average_watched_videos_per_day,
            ( SELECT (avg(usav.length_seconds))::integer AS avg
                   FROM public.user_session_view usav
                  WHERE (usav.user_id = u.id)) AS average_session_length_seconds,
            ( SELECT count((ecv.has_successful_session)::integer) AS count
                   FROM public.exam_completed_view ecv
                  WHERE (ecv.user_id = u.id)) AS total_done_exams,
            ( SELECT (count(uprv.total_given_answer_count))::integer AS count
                   FROM public.user_practise_recommendation_view uprv
                  WHERE (uprv.is_recommended_for_practise IS TRUE)) AS videos_to_be_repeated_count
           FROM (((public."user" u
             LEFT JOIN public.user_performance_view upv ON ((upv.user_id = u.id)))
             LEFT JOIN public.user_session_block_view usbv ON ((usbv.user_id = u.id)))
             LEFT JOIN public.user_reaction_time_view urtv ON ((urtv.user_id = u.id)))
          WHERE (u.deletion_date IS NULL)
          GROUP BY u.id, u.email, urtv.reaction_time_percent_diff, urtv.user_reaction_time_points, urtv.user_exam_length_points, urtv.total_user_reaction_time_points, usbv.average_session_block
          ORDER BY u.id
        )
 SELECT st.user_id,
    st.user_email,
    st.performance_percentage,
    st.user_reaction_time_difference_percentage,
    st.user_reaction_time_points,
    st.user_exam_length_points,
    st.total_user_reaction_time_points,
    st.most_frequent_time_range,
    st.engagement_points,
    st.total_time_active_on_platform_seconds,
    st.watched_videos,
    st.completed_exam_count,
    st.answered_video_and_practise_quiz_questions,
    st.correct_answered_video_and_practise_quiz_questions,
    st.average_watched_videos_per_day,
    st.average_session_length_seconds,
    st.total_done_exams,
    st.videos_to_be_repeated_count,
        CASE
            WHEN (st.answered_video_and_practise_quiz_questions = 0) THEN (0)::double precision
            ELSE (((st.correct_answered_video_and_practise_quiz_questions)::double precision / (st.answered_video_and_practise_quiz_questions)::double precision) * (100)::double precision)
        END AS correct_answer_rate_percentage,
    (((((st.engagement_points * 3))::double precision + (st.performance_percentage * (3)::double precision)) + (((100)::numeric * 0.5))::double precision) / (6.5)::double precision) AS overall_performance_percentage
   FROM stats st;


ALTER TABLE public.user_learning_overview_stats_view OWNER TO dev_service_user;

--
-- Name: user_learning_page_stats_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_learning_page_stats_view AS
 WITH answer_stats AS (
         SELECT ase.user_id,
            (count(ga.id))::integer AS total_given_answer_count,
            (sum((((ga.state)::text = 'CORRECT'::text))::integer))::integer AS total_correct_given_answer_count
           FROM ((public.given_answer ga
             LEFT JOIN public.answer_session ase ON ((ase.id = ga.answer_session_id)))
             LEFT JOIN public.question_version qv ON (((qv.id = ga.question_version_id) AND (qv.video_version_id IS NOT NULL))))
          GROUP BY ase.user_id
        ), company_avg_coins AS (
         SELECT u_1.company_id,
            avg(ct.amount) AS avg_coins_aquired_by_company
           FROM ((public."user" u_1
             LEFT JOIN public.coin_transaction ct ON ((ct.user_id = u_1.id)))
             LEFT JOIN public.company ON ((company.id = u_1.company_id)))
          GROUP BY u_1.company_id
        ), user_coins AS (
         SELECT u_1.id AS user_id,
            sum(ct.amount) AS total_coins_aquired_per_user
           FROM (public."user" u_1
             LEFT JOIN public.coin_transaction ct ON ((ct.user_id = u_1.id)))
          GROUP BY u_1.id
        ), user_rank_inside_company AS (
         SELECT u_1.id AS user_id,
            round(((((uc.total_coins_aquired_per_user)::numeric / cac.avg_coins_aquired_by_company))::double precision * (100)::double precision)) AS user_rank_by_coin_percentage
           FROM ((public."user" u_1
             LEFT JOIN company_avg_coins cac ON ((cac.company_id = u_1.company_id)))
             LEFT JOIN user_coins uc ON ((uc.user_id = u_1.id)))
        )
 SELECT u.id AS user_id,
    u.email AS user_email,
    ( SELECT COALESCE(sum((uprv.is_recommended_for_practise)::integer), (0)::bigint) AS "coalesce"
           FROM public.user_practise_recommendation_view uprv
          WHERE (uprv.user_id = u.id)) AS videos_to_be_repeated_count,
    ( SELECT (count(*))::integer AS count
           FROM (((public.question qu
             LEFT JOIN public.question_version qv ON ((qv.id = qu.id)))
             LEFT JOIN public.given_answer ga ON ((ga.question_version_id = qv.id)))
             LEFT JOIN public.answer_session ase ON ((ase.id = ga.answer_session_id)))
          WHERE ((ase.user_id = u.id) AND (qv.video_version_id IS NOT NULL) AND ((ga.state)::text = 'CORRECT'::text))) AS questions_to_be_repeated_count,
    ( SELECT (count(*))::integer AS count
           FROM public.course_item_completion_view cicv
          WHERE (cicv.user_id = u.id)) AS completed_video_count,
    ( SELECT (sum(usav.length_seconds))::integer AS sum
           FROM public.user_session_view usav
          WHERE (usav.user_id = u.id)) AS total_session_length_seconds,
    ( SELECT (count(*))::integer AS count
           FROM (((public.question qu
             LEFT JOIN public.question_version qv ON ((qv.id = qu.id)))
             LEFT JOIN public.given_answer ga ON ((ga.question_version_id = qv.id)))
             LEFT JOIN public.answer_session ase ON ((ase.id = ga.answer_session_id)))
          WHERE ((ase.user_id = u.id) AND (qv.video_version_id IS NOT NULL))) AS answered_questions_count,
        CASE
            WHEN (ast.total_given_answer_count = 0) THEN (0)::numeric
            ELSE ((((ast.total_correct_given_answer_count)::double precision / (ast.total_given_answer_count)::double precision) * (100)::double precision))::numeric
        END AS total_correct_answer_rate,
        CASE
            WHEN (uric.user_rank_by_coin_percentage > (90)::double precision) THEN (10)::double precision
            ELSE ((100)::double precision - uric.user_rank_by_coin_percentage)
        END AS rank_inside_company
   FROM ((public."user" u
     LEFT JOIN answer_stats ast ON ((ast.user_id = u.id)))
     LEFT JOIN user_rank_inside_company uric ON ((uric.user_id = u.id)))
  WHERE (u.deletion_date IS NULL)
  ORDER BY u.id;


ALTER TABLE public.user_learning_page_stats_view OWNER TO dev_service_user;

--
-- Name: user_module_performance_answer_group_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_module_performance_answer_group_view AS
 SELECT carsv.user_id,
    carsv.course_id,
    carsv.module_id,
    (avg(carsv.exam_correct_answer_rate))::double precision AS exam_correct_answer_rate,
    (avg(carsv.practise_correct_answer_rate))::double precision AS practise_correct_answer_rate,
    (avg(carsv.video_correct_answer_rate))::double precision AS video_correct_answer_rate
   FROM public.correct_answer_rates_split_view carsv
  GROUP BY carsv.user_id, carsv.course_id, carsv.module_id
  ORDER BY carsv.user_id, carsv.course_id, carsv.module_id;


