--
-- Name: user_performance_comparison_stats_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_performance_comparison_stats_view AS
 WITH user_performances AS (
         SELECT u_1.id AS user_id,
            avg(upv.performance_percentage) AS user_performance_average
           FROM (public."user" u_1
             LEFT JOIN public.user_performance_view upv ON ((upv.user_id = u_1.id)))
          GROUP BY u_1.id
        ), watched_videos AS (
         SELECT cic.user_id,
            sum(((cic.video_version_id IS NOT NULL))::integer) AS watched_videos_count
           FROM public.course_item_completion_view cic
          GROUP BY cic.user_id
        ), engagement_points AS (
         SELECT uev.user_id,
            uev.engagement_points
           FROM public.user_engagement_view uev
        ), required_or_started_courses AS (
         SELECT ucb.user_id,
            ((count(*))::integer)::boolean AS is_any_course_required_or_started
           FROM public.user_course_bridge ucb
          WHERE ((ucb.start_date IS NOT NULL) OR (ucb.required_completion_date IS NOT NULL))
          GROUP BY ucb.user_id
        )
 SELECT up.user_id,
    u.company_id,
    u.creation_date,
    rosc.is_any_course_required_or_started,
    up.user_performance_average,
    COALESCE(ep.engagement_points, 0) AS engagement_points,
    COALESCE(wv.watched_videos_count, (0)::bigint) AS watched_videos_count
   FROM ((((user_performances up
     LEFT JOIN watched_videos wv ON ((wv.user_id = up.user_id)))
     LEFT JOIN engagement_points ep ON ((ep.user_id = up.user_id)))
     LEFT JOIN public."user" u ON ((u.id = up.user_id)))
     LEFT JOIN required_or_started_courses rosc ON ((rosc.user_id = up.user_id)));


