    COALESCE((sum(cstv.total_video_watch_elapsed_time))::integer, 0) AS total_video_watch_elapsed_time,
    COALESCE(((sum(cstv.total_practise_question_elapsed_time))::integer + (sum(cstv.total_video_question_elapsed_time))::integer), 0) AS total_question_elapsed_time,
    COALESCE(((sum(usv.length_seconds))::integer - (sum(cstv.total_spent_seconds))::integer), 0) AS other_total_spent_seconds
   FROM ((public."user" u
     LEFT JOIN public.course_spent_time_view cstv ON ((u.id = cstv.user_id)))
