--
-- Name: user_video_practise_progress_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_video_practise_progress_view AS
 SELECT sq2.user_id,
    sq2.video_id,
    sq2.creation_date,
    sq2.playback_duration,
    sq2.length_seconds,
    (((sq2.playback_duration)::double precision / sq2.length_seconds) * (100)::double precision) AS watch_percentage
   FROM ( SELECT sq.user_id,
            sq.video_id,
            min(sq.creation_date) AS creation_date,
            sum(sq.total_playback_duration) AS playback_duration,
            sq.length_seconds
           FROM ( SELECT vpsv.user_id,
                    vv.video_id,
                    vv.id AS video_version_id,
                    vpsv.creation_date,
                    min(vpsv.from_seconds) AS min,
                    max(vpsv.to_seconds) AS max,
                    vd.video_file_length_seconds AS length_seconds,
                    vpsv.total_playback_duration,
                    (row_number() OVER (ORDER BY vpsv.creation_date) - row_number() OVER (PARTITION BY vv.video_id ORDER BY vpsv.creation_date)) AS grp
                   FROM ((public.video_playback_sample_view vpsv
                     LEFT JOIN public.video_version vv ON ((vv.id = vpsv.video_version_id)))
                     LEFT JOIN public.video_data vd ON ((vd.id = vv.video_data_id)))
                  GROUP BY vd.video_file_length_seconds, vpsv.user_id, vv.video_id, vv.id, vpsv.creation_date, vpsv.total_playback_duration) sq
          GROUP BY sq.grp, sq.video_id, sq.user_id, sq.length_seconds) sq2;


