--
-- Name: user_video_stats_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.user_video_stats_view AS
 WITH video_replays_cte AS (
         SELECT uvppv.video_id,
            uvppv.user_id,
            (GREATEST((count(*) - 1), (0)::bigint))::integer AS video_repetition_count
           FROM public.user_video_practise_progress_view uvppv
          GROUP BY uvppv.user_id, uvppv.video_id
        ), summed_video_playbacks_cte AS (
         SELECT uvpsv_1.user_id,
            uvpsv_1.video_id,
            sum(uvpsv_1.total_playback_seconds) AS total_playback_seconds
           FROM public.user_video_playback_seconds_view uvpsv_1
          GROUP BY uvpsv_1.user_id, uvpsv_1.video_id
        ), last_3_quiz_answer_avg_cte AS (
         SELECT asv.user_id,
            vv_1.video_id,
            (avg((((ga.state)::text = 'CORRECT'::text))::integer))::integer AS average_correct_given_answer_count
           FROM ((public.given_answer ga
             LEFT JOIN public.answer_session_view asv ON ((asv.answer_session_id = ga.answer_session_id)))
             JOIN public.video_version vv_1 ON ((vv_1.id = asv.video_version_id)))
          GROUP BY vv_1.video_id, asv.user_id
        ), avg_reaction_time_cte AS (
         SELECT uav.user_id,
            uav.video_id,
            avg(uav.elapsed_seconds) AS avg_reaction_time
           FROM public.user_answer_view uav
          WHERE ((uav.elapsed_seconds IS NOT NULL) AND (uav.video_id IS NOT NULL))
          GROUP BY uav.user_id, uav.video_id
        ), latest_playback_date_cte AS (
         SELECT uvppv.user_id,
            uvppv.video_id,
            max(uvppv.creation_date) AS latest_playback_date
           FROM public.user_video_practise_progress_view uvppv
          GROUP BY uvppv.user_id, uvppv.video_id
        )
 SELECT u.id AS user_id,
    cisv.video_id,
    cisv.course_id,
    vd.video_file_length_seconds AS length_seconds,
    vd.title AS video_title,
    uvpsv.total_playback_seconds AS total_spent_time_seconds,
    vrc.video_repetition_count AS video_replays_count,
    uprv.is_recommended_for_practise AS is_recommended_for_retry,
    l3qaac.average_correct_given_answer_count AS last_three_answer_average,
    artc.avg_reaction_time AS average_reaction_time,
    lpdc.latest_playback_date AS last_watch_time
   FROM (((((((((summed_video_playbacks_cte uvpsv
     LEFT JOIN public."user" u ON ((u.id = uvpsv.user_id)))
     JOIN public.user_playlist_view cisv ON (((cisv.user_id = u.id) AND (cisv.video_id = uvpsv.video_id))))
     JOIN public.video_version vv ON ((vv.id = cisv.video_version_id)))
     LEFT JOIN public.video_data vd ON ((vd.id = vv.video_data_id)))
     LEFT JOIN video_replays_cte vrc ON (((vrc.user_id = u.id) AND (vrc.video_id = vv.video_id))))
     LEFT JOIN public.user_practise_recommendation_view uprv ON (((uprv.video_id = vv.video_id) AND (uprv.user_id = u.id))))
     LEFT JOIN last_3_quiz_answer_avg_cte l3qaac ON (((l3qaac.video_id = vv.video_id) AND (l3qaac.user_id = u.id))))
     LEFT JOIN avg_reaction_time_cte artc ON (((artc.video_id = vv.video_id) AND (artc.user_id = u.id))))
     LEFT JOIN latest_playback_date_cte lpdc ON (((lpdc.video_id = vv.video_id) AND (lpdc.user_id = u.id))));


ALTER TABLE public.user_video_stats_view OWNER TO dev_service_user;

