--
-- Name: video_player_data_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.video_player_data_view AS
 SELECT vv.video_id,
    vv.id AS video_version_id,
    vd.id AS video_data_id,
    mv.id AS module_version_id,
    mv.course_version_id,
    vd.subtitle,
    vd.title,
    vd.description,
    sf.file_path AS thumbnail_url,
    sf2.file_path AS video_file_path
   FROM ((((public.video_version vv
     LEFT JOIN public.video_data vd ON ((vd.id = vv.video_data_id)))
     LEFT JOIN public.storage_file sf ON ((sf.id = vd.thumbnail_file_id)))
     LEFT JOIN public.storage_file sf2 ON ((sf2.id = vd.video_file_id)))
     LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)));


ALTER TABLE public.video_player_data_view OWNER TO dev_service_user;

