--
-- Name: video_version_view; Type: VIEW; Schema: public; Owner: dev_service_user
--

CREATE VIEW public.video_version_view AS
 WITH latest_version AS (
         SELECT max(video_version.id) AS id,
            video_version.video_id
           FROM public.video_version
          GROUP BY video_version.video_id
        )
 SELECT v.id AS video_id,
    vv.id AS video_version_id,
    vd.id AS video_data_id,
    mv.id AS module_version_id,
    mv.course_version_id
   FROM ((((latest_version lv
     LEFT JOIN public.video v ON ((v.id = lv.video_id)))
     LEFT JOIN public.video_version vv ON ((vv.id = lv.id)))
     LEFT JOIN public.video_data vd ON ((vd.id = vv.video_data_id)))
     LEFT JOIN public.module_version mv ON ((mv.id = vv.module_version_id)));


ALTER TABLE public.video_version_view OWNER TO dev_service_user;

