--
-- Name: personality_trait_view _RETURN; Type: RULE; Schema: public; Owner: dev_service_user
--

CREATE OR REPLACE VIEW public.personality_trait_view AS
 WITH latest_question_versions AS (
         SELECT qv.id AS version_id,
            qv.personality_trait_category_id
           FROM public.question_version qv
          WHERE (qv.personality_trait_category_id IS NOT NULL)
        ), latest_given_answer AS (
         SELECT max(ga.id) AS ga_id,
            ga.question_version_id,
            ase.user_id
           FROM (public.given_answer ga
             LEFT JOIN public.answer_session ase ON ((ase.id = ga.answer_session_id)))
          GROUP BY ga.question_version_id, ase.user_id
        ), calc_scores AS (
         SELECT u_1.id AS user_id,
            u_1.email,
            ptc_1.id AS personality_trait_category_id,
            count(ga.id) AS given_answer_count,
            (COALESCE(sum((((ga.state)::text = 'CORRECT'::text))::integer), (0)::bigint))::integer AS max_score,
            (COALESCE(sum((((ga.state)::text <> 'CORRECT'::text))::integer), (0)::bigint))::integer AS min_score
           FROM (((((public.personality_trait_category ptc_1
             CROSS JOIN public."user" u_1)
             LEFT JOIN latest_question_versions lqv ON ((lqv.personality_trait_category_id = ptc_1.id)))
             LEFT JOIN public.question_version qv ON ((qv.id = lqv.version_id)))
             LEFT JOIN latest_given_answer lga ON (((lga.question_version_id = qv.id) AND (lga.user_id = u_1.id))))
             LEFT JOIN public.given_answer ga ON ((ga.id = lga.ga_id)))
          GROUP BY u_1.id, ptc_1.id
          ORDER BY u_1.id, ptc_1.id
        )
 SELECT u.id AS user_id,
    ptc.id AS trait_category_id,
    ptc.title AS trait_category_title,
    cs.max_score,
    cs.min_score,
        CASE
            WHEN (cs.max_score > cs.min_score) THEN ptc.max_label
            ELSE ptc.min_label
        END AS active_label,
        CASE
            WHEN (cs.max_score > cs.min_score) THEN ptc.max_description
            ELSE ptc.min_description
        END AS active_description,
    ptc.min_label,
    ptc.max_label,
    ptc.min_description,
    ptc.max_description
   FROM ((public.personality_trait_category ptc
     CROSS JOIN public."user" u)
     LEFT JOIN calc_scores cs ON (((cs.personality_trait_category_id = ptc.id) AND (cs.user_id = u.id))))
  ORDER BY u.id;


--
-- Name: user_video_playback_seconds_view _RETURN; Type: RULE; Schema: public; Owner: dev_service_user
--

CREATE OR REPLACE VIEW public.user_video_playback_seconds_view AS
 SELECT vpsv.user_id,
    vv.video_id,
    sum(vpsv.total_playback_duration) AS total_playback_seconds
   FROM (public.video_playback_sample_view vpsv
     LEFT JOIN public.video_version vv ON ((vv.id = vpsv.video_version_id)))
  GROUP BY vpsv.user_id, vv.id;


